INSERT INTO `ps_product_lang` VALUES
(20,1,1,'Ręcznik plażowy szybkoschnący\nRęcznik plażowy o wymiarach 140 cm x 70 cm. Idealne rozwiązanie na lato. Rozmiar ręcznika pasuje do leżaków plażowych. \nRęcznik wykonany jest z wysokiej jakości szybkoschnącego poliestru. Wystarczy kilka chwil, by był suchy.','','recznik-plazowy-boisko','','','','Ręcznik plażowy boisko','','','',''),
(20,1,2,'','','','','','','','','','',''),
(21,1,1,'Ręcznik plażowy szybkoschnący\nRęcznik plażowy o wymiarach 140 cm x 70 cm. Idealne rozwiązanie na lato. Rozmiar ręcznika pasuje do leżaków plażowych. \nRęcznik wykonany jest z wysokiej jakości szybkoschnącego poliestru. Wystarczy kilka chwil, by był suchy.','','recznik-plazowy-keeza','','','','Ręcznik plażowy keeza','','','',''),
(21,1,2,'','','','','','','','','','',''),
(22,1,1,'Bawełniana torba na ramię z nadrukiem DTF\nTorba jest wykonana z wysokiej jakości bawełny, zapewnia trwałość i długotrwałe użytkowanie, co czyni ją doskonałą alternatywą dla jednorazowych toreb plastikowych. Torba posiada długi uchwyt na ramię, który pozwala na wygodne noszenie na co dzień. Bez względu na to, czy potrzebujesz torby na zakupy, do pracy czy na wypad na plażę, nasza torba jest idealnym towarzyszem w codziennych aktywnościach.\n\n100% surówka bawełniana \nrozmiar 38 x 42cm\nkolor ecru\nnadruk DTF \nuchwyt ok. 31 cm','','torba-bawelniana-keeza','','','','Torba bawełniana KEEZA','','','',''),
(22,1,2,'','','','','','','','','','',''),
(23,1,1,'Bawełniana torba na ramię z nadrukiem DTF\nTorba jest wykonana z wysokiej jakości bawełny, zapewnia trwałość i długotrwałe użytkowanie, co czyni ją doskonałą alternatywą dla jednorazowych toreb plastikowych. Torba posiada długi uchwyt na ramię, który pozwala na wygodne noszenie na co dzień. Bez względu na to, czy potrzebujesz torby na zakupy, do pracy czy na wypad na plażę, nasza torba jest idealnym towarzyszem w codziennych aktywnościach.\n\n100% surówka bawełniana \nrozmiar 38 x 42cm\nkolor ecru\nnadruk DTF \nuchwyt ok. 31 cm','','torba-bawelniana-kwiaty','','','','Torba bawełniana Kwiaty','','','',''),
(23,1,2,'','','','','','','','','','',''),
(24,1,1,'Rozpinana bluza keeza z kapturem\nRozpinana bluza z kapturem marki KEEZA - połączenie wygody i stylu. Solidna gramatura 290 g zapewnia ciepło i trwałość, a kompozycja 35% bawełny i 65% poliestru gwarantuje komfort noszenia. Praktyczne naszywane kieszenie doskonale sprawdzą się na co dzień, a wzmocnione lycrą ściągacze długo zachowają swój kształt. Subtelne logo KEEZA umieszczone na piersi podkreśla jakość i dbałość o detale. Sznurowany kaptur dodaje charakteru i pozwala na indywidualne dopasowanie. Wybierz markę KEEZA i postaw na jakość oraz niezawodny design.','','rozpinana-bluza-z-kapturem','','','','Rozpinana bluza z kapturem','','','',''),
(24,1,2,'','','','','','','','','','',''),
(25,1,1,'Bluza z haftowanym logo\nBluza wkładana przez głowę z haftem na klatce piersiowej. \nTa bluza ma prosty, ale stylowy krój basic, który pasuje do wielu różnych stylizacji. Możesz nosić ją na co dzień, do szkoły, pracy czy na spotkania ze znajomymi. Jest wykonana z wygodnego i trwałego materiału, który zapewnia komfort noszenia przez długi czas.\nSkład:\n\n35% bawełna\n65% poliester','','bluza-keeza-basic-bordo','','','','Bluza KEEZA Basic Bordo','','','',''),
(25,1,2,'','','','','','','','','','',''),
(26,1,1,'Bluza z haftowanym logo\nBluza wkładana przez głowę z haftem na klatce piersiowej. \nTa bluza ma prosty, ale stylowy krój basic, który pasuje do wielu różnych stylizacji. Możesz nosić ją na co dzień, do szkoły, pracy czy na spotkania ze znajomymi. Jest wykonana z wygodnego i trwałego materiału, który zapewnia komfort noszenia przez długi czas.\nSkład:\n\n35% bawełna\n65% poliester','','bluza-keeza-basic-green','','','','Bluza KEEZA Basic Green','','','',''),
(26,1,2,'','','','','','','','','','',''),
(27,1,1,'Bluza KEEZA \"e\" ORANGE\n\nPodwójne przeszycia ściągaczy i rękawów\nŚciągacze wzmocnione lycrą\nSkład:  65% poliester - 35% bawełna\nGramatura: 290 g\n\nBluza dresowa to komfortowy element garderoby, który może być zarówno praktyczny, jak i modny. Wykonana została z miękkiego i elastycznego materiału (mieszanka bawełny z poliestrem) Dzięki temu jest ona wyjątkowo wygodna i przewiewna. Bluza dresowa w odcieniu pomarańczowego może być świetnym wyborem na letnie dni.','','bluza-bawelniana-e-orange','','','','Bluza bawełniana \"e\" Orange','','','',''),
(27,1,2,'','','','','','','','','','',''),
(28,1,1,'Bluza KEEZA \"e\" PINK\n\nPodwójne przeszycia ściągaczy i rękawów\nŚciągacze wzmocnione lycrą\nSkład:  65% poliester - 35% bawełna\nGramatura: 290 g\n\nBluza dresowa to komfortowy element garderoby, który może być zarówno praktyczny, jak i modny. Wykonana została z miękkiego i elastycznego materiału (mieszanka bawełny z poliestrem) Dzięki temu jest ona wyjątkowo wygodna i przewiewna. Bluza dresowa w odcieniu pomarańczowego może być świetnym wyborem na letnie dni.','','bluza-bawelniana-e-pink','','','','Bluza bawełniana \"e\" PINK','','','',''),
(28,1,2,'','','','','','','','','','',''),
(29,1,1,'Bawełniana bluza sportowa B&amp;G\nBardzo wygodna i miła w dotyku bluza sportowa wykonana z miękkiej bawełny z sygnowanymi lampasami i logiem KEEZA na piersi. Dół bluzy oraz rękawy zostały wykończone praktycznymi ściągaczami. Produkt w szaro-czarnych kolorach świetnie wpisuje się w najnowsze trendy modowe.   Skład: miękka i oddychająca bawełna 320 g','','bluza-bawelniana-keeza-bg','','','','Bluza bawełniana KEEZA B&G','','','',''),
(29,1,2,'','','','','','','','','','',''),
(30,1,1,'Bawełniana bluza z kapturem \nSkład: miękka i oddychająca bawełna 290 g\nBluza bawełniana w kolorze Royal Blue z kapturem i kieszenią kangurką to idealna propozycja dla miłośników wygody i stylu. Wykonana z najwyższej jakości bawełny, ta bluza jest nie tylko miła w dotyku, ale także zapewnia wysoki poziom komfortu użytkowania.\nKaptur i kangurka to elementy, które dodają bluzie sportowego charakteru, ale także praktyczności. Sznurki umożliwiają regulację kaptura, dzięki czemu można dostosować jego rozmiar do indywidualnych potrzeb. Kangurka to praktyczna kieszeń, która umożliwia przechowywanie drobnych przedmiotów lub ogrzewanie dłoni w chłodne dni.\nLogo KEEZA umieszczone na klatce piersiowej to dodatkowy element, który nadaje bluzie oryginalnego wyglądu i sprawia, że wyróżnia się na tle innych ubrań. Kolor Royal Blue to modny i uniwersalny wybór, który idealnie sprawdzi się w różnych sytuacjach.\nBluza bawełniana z kapturem i kangurką oraz logo KEEZA na klatce piersiowej to doskonała propozycja dla osób, które cenią sobie wygodę i nie chcą rezygnować z stylu. Dzięki swojemu wyjątkowemu designowi i wysokiej jakości materiałom, ta bluza będzie służyć przez długi czas.','','bluza-bawelniana-keeza-niebieska','','','','Bluza bawełniana Keeza niebieska','','','',''),
(30,1,2,'','','','','','','','','','',''),
(31,1,1,'Bawełniana bluza z kapturem \nSkład: miękka i oddychająca bawełna 280 g\nBluza bawełniana w kolorze czarnym to doskonała propozycja dla osób ceniących sobie wygodę i stylowy wygląd. Wykonana z najwyższej jakości bawełny, ta bluza jest nie tylko miła w dotyku, ale także zapewnia wysoki poziom komfortu użytkowania.\nKangurka to element, który dodaje bluzie sportowego charakteru, ale także praktyczności. Kieszeń ta umożliwia przechowywanie drobnych przedmiotów lub ogrzewanie dłoni w chłodne dni. Kaptur z sznurkami umożliwia regulację jego rozmiaru, co pozwala dostosować go do indywidualnych potrzeb użytkownika.\nLogo KEEZA umieszczone na klatce piersiowej w wyróżniającym się czarnym kolorze to dodatkowy element, który nadaje bluzie oryginalnego wyglądu i sprawia, że wyróżnia się na tle innych ubrań. Dzięki nadrukowi wykonanemu metodą DTF, logo jest trwałe i odporne na uszkodzenia.\nKolor czarny to klasyczny wybór, który idealnie sprawdzi się w różnych sytuacjach i pozwoli stworzyć wiele stylizacji. Miękka w dotyku bawełna gwarantuje wygodę i swobodę ruchów, dzięki czemu bluza będzie doskonałą propozycją dla osób aktywnych fizycznie.\nBluza bawełniana z kieszenią kangurką, kapturem, sznurkami i logo KEEZA na klatce piersiowej to doskonała propozycja dla osób, które cenią sobie wygodę i nie chcą rezygnować z modnego wyglądu. Oryginalny design, wysokiej jakości materiały oraz trwały nadruk sprawią, że ta bluza będzie służyła przez długi czas.','','bluza-bawelniana-keeza','','','','Bluza bawełniana Keeza','','','',''),
(31,1,2,'','','','','','','','','','',''),
(32,1,1,'Bawełniana bluza oversize\n\n100% bawełna 240 g\n\nBawełniana bluza dla kobiet w stylu oversize to idealna propozycja dla każdej kobiety, która ceni sobie wygodę i luźny styl.\nNie posiada kaptura, co pozwala na swobodne układanie fryzury i dodanie indywidualnego stylu.Rękawy oraz dół bluzy wykończone są ściągaczami.\nMateriał, z jakiego została wykonana bluza, to lejąca się bawełna wysokiej jakości.Gramatura materiału wynosi 240 g, co sprawia, że bluza jest wytrzymała i przewiewna,dzięki czemu zapewnia komfort termiczny w każdych warunkach.\nNa piersi bluzy znajduje się haftowany sygnet keeza, który dodaje elegancji i charakteru całej stylizacji.Ta bawełniana bluza to idealny wybór dla kobiet, które cenią sobie wygodę i luźny styl, nie rezygnując przy tym z elegancji i wysokiej jakości wykonania.','','bluza-damska-jolie-e','','','','Bluza damska Jolie \"e\"','','','',''),
(32,1,2,'','','','','','','','','','',''),
(33,1,1,'Bawełniana bluza oversize dla kobiet\n\n90% bawełna 320 g\n10% poliester\n\nTa bawełniana bluza dla kobiet w stylu oversize to idealna propozycja dla każdej kobiety, która ceni sobie wygodę i swobodny styl. Bez kaptura, posiada ściągacze na końcach rękawów oraz ściągacz u dołu bluzy, co zapewnia idealne dopasowanie do sylwetki i swobodę ruchów.\nMateriał, z którego wykonana jest ta bluza, to lejąca się bawełna wysokiej jakości z dodatkiem poliestru, co czyni ją bardziej odporną na zagniecenia i deformacje. Gramatura materiału wynosi 320 g, co daje poczucie luksusowej jakości i trwałości.\nNa przodzie bluzy znajduje się haftowane logo keeza, które dodaje charakteru i wyróżnia ją z tłumu. Ta bawełniana bluza to idealny wybór dla kobiet, które cenią sobie swobodę ruchów i komfort, ale nie chcą rezygnować z jakości i stylu. Dzięki lejącemu się materiałowi i dobremu dopasowaniu, ta bluza stanie się ulubionym elementem garderoby każdej kobiety.','','bluza-damska-jolie-keeza','','','','Bluza damska Jolie keeza','','','',''),
(33,1,2,'','','','','','','','','','',''),
(34,1,1,'Bluza damska z haftem\nBluza ze skróconym krojem w luźnym fasonie jest idealnym rozwiązaniem dla wszystkich kobiet ceniących sobie komfort w połączeniu z modnymi stylizacjami. Bluza Madison posiada kaptur, sygnowane troczki oraz wyhaftowane logo keeza, które dodaje jej nieco elegancji.\n100% bawełna pętelkowa (280 g)','','bluza-damska-madison','','','','Bluza damska Madison','','','',''),
(34,1,2,'','','','','','','','','','',''),
(35,1,1,'Bluza z haftowanym logo\nBluza bawełniana wkładana przez głowę z haftem na klatce piersiowej. Bluza o obniżonych ramionach z elastycznymi ściągaczami. Przyjemny w dotyku materiał gwarantuje komfort podczas noszenia. \nSkład:\n\n90% bawełna\n10% poliester\ngramatura: 320 g','','bluza-dresowa-ontario','','','','Bluza dresowa Ontario','','','',''),
(35,1,2,'','','','','','','','','','',''),
(36,1,1,'Damska bluza fitness\nKomfortowa bawełniana bluza przeznaczona dla miłośniczek sportu.\nStylowa, krótka bluza fitness z serii Stay Active wykonana jest pętelkowej bawełny o gramaturze 280 g. Zadbaj o komfort i styl także podczas treningu.\nMateriał: bawełna 100% (280g)Rozmiary: XS/S oraz M/L','','bluza-fitness-fargo','','','','Bluza fitness Fargo','','','',''),
(36,1,2,'','','','','','','','','','',''),
(37,1,1,'Bluza z kapturem i nadrukiem Field\nKlasyczna bluza kangurka z kapturem w czarnym kolorze. Dzięki specjalnej mieszance materiału, bluza jest odporna na zagniecenia i przy tym niezwykle miła w dotyku. \nNiezależnie od tego, czy szukasz czegoś na leniwe wieczory w domu, czy też chcesz stworzyć casualowy, modny outfit, nasza bluza kangurka zapewni Ci to, czego potrzebujesz.\nWykonana z najwyższej jakości, miękkiego i przyjemnego w dotyku materiału, ta bluza gwarantuje niezrównaną wygodę przez cały dzień.\n\nPodwójne przeszycia ściągaczy i rękawów\nŚciągacze wzmocnione lycrą\nSkład:  65% poliester - 35% bawełna\nGramatura: 290 g','','bluza-kangurka-field','','','','Bluza kangurka Field','','','',''),
(37,1,2,'','','','','','','','','','',''),
(38,1,1,'Bluza z kapturem i sygnetem \"e\"\nPodkreśl swój styl z naszą zieloną bluzą z kapturem! Wykonana z doskonałej mieszanki bawełny i poliestru, zapewnia komfort noszenia i trwałość. Idealna na chłodniejsze dni, doskonale komponuje się z różnymi stylizacjami.\nProsty, ale wyrafinowany design sprawi, że będziesz wyglądać modnie w każdej sytuacji. Skomponuj ją z ulubionymi jeansami lub spodniami dresowymi i wyrusz na podbój miasta!\n\nPodwójne przeszycia ściągaczy i rękawów\nŚciągacze wzmocnione lycrą\nSkład:  65% poliester - 35% bawełna\nGramatura: 290 g','','bluza-kangurka-green','','','','Bluza kangurka Green','','','',''),
(38,1,2,'','','','','','','','','','',''),
(39,1,1,'Bluza z kapturem i nadrukiem triple keeza\nNasza najnowsza bluza z kapturem to esencja wygody i nowoczesnego designu. Stworzona z komfortowej mieszanki bawełny i poliestru, jest gwarancją trwałości i przyjemności noszenia. Unikatowy nadruk \"keeza\" dodaje jej niepowtarzalnego charakteru.\nBluza dostępna jest w dwóch klasycznych kolorach – czarnym i białym, dzięki czemu doskonale wpisuje się w każdą garderobę i pozwala na różnorodne kombinacje stylizacyjne. Wybierz swój ulubiony kolor i wyraź siebie!\n\nPodwójne przeszycia ściągaczy i rękawów\nŚciągacze wzmocnione lycrą\nSkład:  65% poliester - 35% bawełna\nGramatura: 290 g','','bluza-kangurka-triple-keeza','','','','Bluza kangurka Triple keeza','','','',''),
(39,1,2,'','','','','','','','','','',''),
(40,1,1,'Bluza kangurka z kapturem\nKlasyczna bluza kangurka z kapturem w kremowym kolorze. Dzięki specjalnej mieszance materiału, bluza jest odporna na zagniecenia i przy tym niezwykle miła w dotyku. \nNiezależnie od tego, czy szukasz czegoś na leniwe wieczory w domu, czy też chcesz stworzyć casualowy, modny outfit, nasza bluza kangurka zapewni Ci to, czego potrzebujesz.\nWykonana z najwyższej jakości, miękkiego i przyjemnego w dotyku materiału, ta bluza gwarantuje niezrównaną wygodę przez cały dzień.\n\nPodwójne przeszycia ściągaczy i rękawów\nŚciągacze wzmocnione lycrą\nSkład:  65% poliester - 35% bawełna\nGramatura: 290 g','','bluza-z-kapturem-kremowa','','','','Bluza z kapturem kremowa','','','',''),
