(43,1,1,'Czapka zimowa \"e\" z pomponem\nGustowna, czarna czapka z pomponem i wyhaftowanym sygnetem \"e\". Produkt pasuje do niemal każdej jesiennej i zimowej stylizacji.\nCzapka wykonana z akrylu, materiału łudząco podobnego do klasycznej wełny, ale jego zaletą jest fakt, że nie uczula i nie powoduje podrażnień na skórze. Nie rób na złość babci i nie odmroź sobie uszu.\nCzapka dostępna jest także w zestawie z kominem polarowym.\n\nElastyczny materiał: 100% akryl\nPompon\nNadruk: haft\nRozmiar: uniwersalny','','czapka-zimowa','','','','Czapka zimowa','','','',''),
