(44,1,1,'Komin polarowy KEEZA\nKomin polarowy wykonany z komfortowego, przyjemnego w kontakcie ze skórą materiału. Jego innowacyjna struktura umożliwia swobodne oddychanie po zasłonięciu ust i nosa.\nProdukt regulowany jest elastycznym ściągaczem ze stoperem, dzięki czemu można w łatwy sposób przekształcić komin w czapkę lub ściślej otulić nim szyję. Komin polarowy KEEZA znakomicie nadaje się do uprawiania sportu na świeżym powietrzu.\n\nWymiary: 29x25 cm (na płasko)\nMateriał: Polar 100% poliester\nNadruk: haft\n\nW ofercie posiadamy także komin polarowy z wyhaftowanym sygnetem \"e\".','','komin-polarowy-keeza','','','','Komin polarowy keeza','','','',''),
