(48,1,1,'Czapka bejsbolówka keeza \nModna, wykonana z najlepszych materiałów i wytrzymała czapka z zakrzywionym daszkiem.\nPasująca do sportowej, jak i lifestylowej stylizacji. 6-panelowa czapka posiada otwory wentylacyjne, których rolą jest zapewnienie odpowiedniej cyrkulacji powietrza.\nCzapka z daszkiem KEEZA posiada metalowe zapięcie, dzięki czemu można ją precyzyjnie dopasować do obwodu głowy.\n• Uniwersalny rozmiar • 6 paneli • Otwory wentylacyjne • Sygnet „e”• 100% bawełna zamszowana• Świetna ochrona przed słońcem','','czapka-z-daszkiem-keeza','','','','Czapka z daszkiem KEEZA','','','',''),
