(57,1,1,'Bawełniana koszulka oversize z nadrukiem na plecach \n\n100% bawełna premium 180 g\n\nKoszulka damska model Virginia to wygodna propozycja dla kobiet, które cenią sobie swobodę i luz w ubraniach. Jest to koszulka oversize, co oznacza, że posiada luźny, obszerny krój, który nie krępuje ruchów. Koszulka jest wykonana z 100% bawełny, co gwarantuje naturalny, przyjemny dla ciała materiał. Gramatura koszulki wynosi 180 g, co oznacza, że jest ona niezwykle miękka i przyjemna w dotyku.\nKoszulka posiada obniżone ramiona, co nadaje jej charakterystyczny, modny wygląd. Szerokie rękawy do łokcia dopełniają całości, tworząc luźny, ale zarazem stylowy outfit. Koszulka Virginia to doskonała propozycja na co dzień, do noszenia w domu, ale również na spacer czy spotkanie ze znajomymi. Dzięki swojemu designowi oraz bawełnianej strukturze, zapewni komfort i wygodę przez cały dzień.','','koszulka-virginia','','','','Koszulka Virginia','','','',''),
(57,1,2,'','','','','','','','','','',''),
(58,1,1,'T-shirt KEEZA Classic Dark\nKoszulka bawełniana z krótkim rękawem i nadrukiem wykonanym w nowoczesnej technologii DTF (direct to film), który jest lekki i miękki w dotyku.\n\nPodwójne szwy na ramionach\nBrak bocznych szwów\nWzmocniony lycrą ściągacz\nTaśma wzmacniająca\nBawełna stabilizowana 190 g\n\nKlasyczna koszulka bawełniana z małym logo Keeza to doskonały wybór dla osób, które poszukują połączenia wygody, trwałości i stylowego wyglądu. Jeśli zależy Ci na wysokiej jakości produktach, które będą Ci towarzyszyć przez wiele sezonów, ta koszulka spełni Twoje oczekiwania.\nNasza koszulka została wykonana z wysokogatunkowej, stabilizowanej bawełny o gramaturze 190 g, co gwarantuje jej wyjątkową wytrzymałość i trwałość. Materiał ten jest miły w dotyku i zapewnia komfort noszenia przez cały dzień.\nPodwójne szwy na ramionach to cecha, która dodaje koszulce solidności i wytrzymałości. Dzięki temu możesz być pewien, że produkt jest starannie uszyty i wytrzyma nawet przy intensywnym użytkowaniu.\nBrak bocznych szwów to kolejna zaleta tej koszulki. Zapewnia ona swobodę ruchów i wygodę noszenia, eliminując potencjalne otarcia czy nieprzyjemne uczucie ucisku.\nWzmocniony lycrą ściągacz na końcach rękawów i na dole koszulki to nie tylko element estetyczny, ale również praktyczny. Zapewnia on doskonałe dopasowanie i utrzymanie kształtu koszulki, niezależnie od intensywności Twoich aktywności.\nDodatkowo, taśma wzmacniająca wewnątrz koszulki przyczynia się do jej trwałości i stabilności, zapewniając długotrwałą satysfakcję z użytkowania.\nNasza klasyczna koszulka bawełniana jest dostępna w ciemnych kolorach, które dodają elegancji i ponadczasowości Twojemu wyglądowi. Bez względu na Twoje preferencje stylowe, z pewnością znajdziesz odpowiedni kolor, który idealnie pasuje do Twojej garderoby.\nOferujemy szeroki wybór rozmiarów, aby każdy mógł znaleźć idealne dopasowanie. Bez względu na to, czy preferujesz luźny czy bardziej obcisły fason, nasza koszulka dostosuje się do Twoich potrzeb.\nWybierając naszą klasyczną koszulkę bawełnianą z małym logo Keeza, otrzymujesz wysoką jakość wykonania, trwałość i dbałość o detale. Ta koszulka to nie tylko modny element Twojej garderoby, ale także wygodna i niezawodna opcja na co dzień.','','koszulka-bawelniana-e-classic-dark','','','','Koszulka bawełniana \"e\" Classic Dark','','','',''),
(58,1,2,'','','','','','','','','','',''),
(59,1,1,'T-shirt KEEZA Classic Dark\nKoszulka bawełniana z krótkim rękawem i nadrukiem wykonanym w nowoczesnej technologii DTF (direct to film), który jest lekki i miękki w dotyku.\n\nPodwójne szwy na ramionach\nBrak bocznych szwów\nWzmocniony lycrą ściągacz\nTaśma wzmacniająca\nBawełna stabilizowana 190 g\n\nKlasyczna koszulka bawełniana marki Keeza z sygnetem \"e\" na piersi to wyjątkowa propozycja dla osób poszukujących połączenia komfortu, stylu i wysokiej jakości wykonania. Oferujemy produkt, który spełni Twoje oczekiwania i podkreśli Twój indywidualny styl. \nNasza koszulka została starannie wykonana z 100% bawełny stabilizowanej o gramaturze 190 g. Ten wysokogatunkowy materiał zapewnia nie tylko miękkość i przyjemność w dotyku, ale także trwałość i wytrzymałość, dzięki czemu będziesz cieszyć się nią przez długi czas.\nPodwójne szwy na ramionach to cecha, która świadczy o solidności i dbałości o szczegóły. Dzięki nim, koszulka jest wytrzymała i niezawodna, nawet przy intensywnym użytkowaniu.\nBrak bocznych szwów to element, który przyczynia się do komfortu noszenia. Pozwala to na swobodę ruchów i eliminuje potencjalne otarcia czy nieprzyjemne uczucie ucisku, zapewniając Ci wygodę przez cały dzień.\nWzmocniony lycrą ściągacz na końcach rękawów i na dole koszulki nie tylko dodaje estetyki, ale także gwarantuje doskonałe dopasowanie i utrzymanie kształtu koszulki, niezależnie od Twoich aktywności.\nDodatkowo, taśma wzmacniająca wewnątrz koszulki zapewnia dodatkową wytrzymałość i stabilność, czyniąc ją bardziej odporną na przetarcia i uszkodzenia.\nKoszulka jest dostępna w ciemnych kolorach, które dodają elegancji i ponadczasowości Twojemu wyglądowi. Bez względu na Twoje preferencje stylowe, z pewnością znajdziesz odpowiedni kolor, który idealnie uzupełni Twoją garderobę.\nOferujemy szeroki wybór rozmiarów, aby zapewnić idealne dopasowanie dla każdego. Niezależnie od tego, czy preferujesz luźny czy bardziej obcisły fason, nasza koszulka z sygnetem \"e\" na piersi dostosuje się do Twoich potrzeb.\nKeeza to marka, która kładzie nacisk na wysoką jakość wykonania i dbałość o detale. Nasza koszulka bawełniana z sygnetem \"e\" na piersi to nie tylko modny element Twojej garderoby, ale także wygodna i niezawodna opcja na co dzień. Wybierając naszą markę, wybierasz jakość i styl.','','koszulka-bawelniana-e-classic-light','','','','Koszulka bawełniana \"e\" Classic Light','','','',''),
(59,1,2,'','','','','','','','','','',''),
(60,1,1,'Koszulka bawełniana z nadrukiem\nKoszulka bawełniana z krótkim rękawem i nadrukiem wykonanym w nowoczesnej technologii DTF (direct to film), który jest lekki i miękki w dotyku.\n\nPodwójne szwy na ramionach\nBrak bocznych szwów\nWzmocniony lycrą ściągacz\nTaśma wzmacniająca\nBawełna stabilizowana 190 g\n\nJeśli szukasz koszulki, która zapewni Ci maksymalny komfort podczas codziennych aktywności, to koszulka bawełniana Keeza jest idealnym wyborem dla Ciebie. Wykonana z wysokiej jakości, naturalnej bawełny o gramaturze 190g, zapewnia przyjemny dotyk i oddychający materiał, który pozostaje miękki i elastyczny nawet po wielu praniach.\nPodwójne szwy na ramionach oraz brak bocznych szwów to cechy, które wyróżniają tę koszulkę na tle innych produktów. Dzięki temu, masz pewność, że koszulka będzie trwała i odporna na uszkodzenia, a przy tym nie będzie uciskała ani krępowała ruchów. Wzmocniony lycrą ściągacz i taśma wzmacniająca dodatkowo poprawiają trwałość i komfort użytkowania.\nKoszulka bawełniana Keeza to nie tylko funkcjonalność, ale również styl. Na przodzie koszulki znajduje się nadruk z logo Keeza, który nadaje koszulce wyjątkowego charakteru i wyróżnia ją na tle innych koszulek. Koszulka jest dostępna w różnych rozmiarach, dzięki czemu każdy znajdzie idealny rozmiar dla siebie.\nJeśli zależy Ci na wygodzie, jakości i stylowym wyglądzie, to koszulka bawełniana Keeza jest dla Ciebie. Możesz nosić ją na co dzień, do szkoły, pracy czy na spotkania ze znajomymi. Jest to produkt, który sprosta wymaganiom nawet najbardziej wymagających osób.','','koszulka-bawelniana-crack','','','','Koszulka bawełniana - crack','','','',''),
