(98,1,1,'Płaszcz, kurtka zimowa Brugia\nCiepła, długa, sięgająca do ud kurtka zimowa o klasycznym kroju. Kurtka posiada logo keeza na piersi oraz na ramionach. Dwie zamykane na suwak boczne kieszenie wykonane są z miłego w dotyku materiału. Produkt posiada także kieszeń wewnętrzną, regulowany stoperami kaptur oraz regulowane rzepem mankiety. Syntetyczne wypełnienie kurtki gwarantuje zachowanie odpowiedniej temperatury ciała.\nKurtka znakomicie nadaje się nie tylko dla piłkarzy, ale także dla trenerów spędzających długie godziny przy ławkach trenerskich w zimne zimowe dni.','','plaszcz-zimowy-brugia','','','','Płaszcz zimowy Brugia','','','',''),
