(117,1,1,'Czapka zimowa \"brrr zima\" w komplecie z szalikiem \nOgrzej się zimą w naszej czapce zimowej z pomponem \"brrr zima\" oraz w dzianym szaliku ze śnieżynkami.\nLifestylowy komplet znakomicie sprawdzi się nie tylko jako uzupełnienie codziennej garderoby, ale także podczas zimowych, górskich wypadów.Zestaw zarówno dla kobiet, mężczyzn, jak i dla dzieci.\nMateriał akrylowy, z którego wykonano komplet jest łudząco podobny do klasycznej wełny, ale nie uczula i nie powoduje podrażnień skórnych. Akryl jest sprężysty, dzięki czemu nie odkształca się, a wykonana z niego odzież nie gniecie się. Czapka i szalik są produktem w całości wykonanym w Polsce.\n\nElastyczny materiał: 100% akryl\nPompon\nFrędzle przy szaliku\nRozmiar: uniwersalny','','czapka-zimowa-i-szalik-brrr-zima','','','','Czapka zimowa i szalik \"brrr zima\"','','','',''),
