(118,1,1,'Fartuch na grilla\nLekki, bardzo wytrzymały fartuch grillowy ze wzorem boiska do piłki nożnej. Produkt poliestrowy, solidnie obszyty. Posiada wygodne zapięcie z metalowymi klamrami na karku oraz dwa sznurki do wiązania wokół pasa.\nFartuch jest idealny na prezent. Sprawdzi się w każdej kuchni i przy grillu.','','fartuch-grillowy','','','','Fartuch grillowy','','','',''),
