(120,1,1,'Worek na buty i na akcesoria\nWorek jest bardzo pojemny, przestronny i bezpieczny, dzięki swojemu wiązaniu na sznur. Posiada łączone ramiączka. Produkt jest odporny na niesprzyjające warunki atmosferyczne, jak wiatr, czy przelotny deszcz. \nNasze worki są wykonane są mocnego i łatwego w czyszczeniu poliestru.\nMateriał: poliester\nWymiary: 50 cm x 40 cm','','worek-na-buty-keeza','','','','Worek na buty KEEZA','','','',''),
