(122,1,1,'Znacznik treningowy KEEZA\nWykonany z lekkiej, przewiewnej siatki poliestrowej, która nie ogranicza swobody ruchu oraz nie podrażnia skóry podczas kontaktu z ciałem. Znacznik jest bardzo wytrzymały, odporny na gwałtowne szarpnięcia.\nRozmiary:\n\nSenior: długość 70 cm\nJunior: długość 58 cm\n\nMateriał: \n\n100 % poliester\n\nZnaczniki treningowe dla dzieci znajdziesz tutaj (klik).','','znacznik-treningowy','','','','Znacznik treningowy','','','',''),
