(124,1,1,'Piłka do piłki nożnej - treningowa Kitara\nHybrydowa piłka przeznaczona do profesjonalnego treningu piłki nożnej.\nWyprodukowana w technologii FlexiFusion (jest szyta i klejona dla większej trwałości) – Kitara, wspomaga piłkarski trening nie zaburzając dokładności kopnięcia oraz trajektorii lotu.\nRozmiar: 4','','pilka-kitara-r-4','','','','Piłka KITARA r. 4','','','',''),
