(125,1,1,'Piłka do piłki nożnej - treningowa LIRA\nWytrzymała, hybrydowa (szyta i klejona – technologia FlexiFusion) piłka treningowa w rozmiarze 3. Charakterystyka piłki Lira to przede wszystkim świetna amortyzacja, nawet po bardzo mocnych odbiciach. \nPiłka jest trwała i nadaje się zarówno do treningu specjalistycznego, jak i do rekreacji.\nRozmiar: 3','','pilka-lira-r-3','','','','Piłka LIRA r. 3','','','',''),
