(128,1,1,'Plecak sportowy Napoli\nUniwersalny plecak sportowy KEEZA, odporny na warunki pogodowe. Plecak nadaje się na trening, wycieczkę, basen, profesjonalny mecz, a także np. na laptopa.\nPlecak sportowy KEEZA z zewnątrz wykonany jest z poliestru. Główna komora otwierana jest na dwa suwaki. Wewnątrz znajduje się dodatkowa, mała kieszeń/przegroda na przykład na portfel. Środek wykonany jest z miłego w dotyku materiału. Z przodu plecaka znajduje się zamykana na ekspres kieszeń. Po bokach są dwie kieszenie idealnie nadające się na przykład na butelkę wody, czy bidon.\nRegulowane miękkie szelki gwarantują komfort noszenia. Plecy wykończone są miękką siatką zapewniającą przewiew pleców.\nParametry:\n\n50x30x15cm\nPojemność: ok 25l\nDuża komora główna\nWewnętrzna przegroda\nFrontowa kieszeń\nKieszenie boczne\nGórny uchwyt do przenoszenia\nRegulowane, wygodne paski na ramiona\n100% poliester','','plecak-napoli','','','','Plecak Napoli','','','',''),
