(129,1,1,'Plecak sportowy Ternana wykonany z poliestru\nKomora główna plecaka oraz przednia kieszeń zamykane są na suwaki. Plecak posiada także regulowane, miękkie szelki.\nNajważniejsze cechy plecaka:\n\npodwójne dno\nkomora na buty (usztywnienie dodatkowo płatne)\ntrwały materiał\npojemność: 30 litrów\n100% poliester\n\nWymiary: \n\ngłębokość: 20 cm\nwysokość: 49 cm\nszerokość: 35 cm\npojemność: 30 litrów \n\nW tym komora dolna: \n\ngłębokość: 20 cm \nwysokość: 13 cm \nszerokość: 35 cm','','plecak-ternana','','','','Plecak Ternana','','','',''),
