(132,1,1,'Torba sportowa na kółkach Empoli\nTorba sportowa Empoli od KEEZA wykonana jest ze wzmocnionego poliestru. Jest wodo- i wiatroodporna. Ma usztywniony spód oraz teleskopową roczkę schowaną w spodzie torby.\nTorba sportowa Empoli posiada także bardzo pojemną kieszeń główną zamykaną na dwukierunkowy suwak. Mniejsza, boczna kieszeń także jest zamykana suwakiem. Torba ma dwa ucha, wygodny pas na ramię oraz dwa kółka ułatwiające jej transport.\nMateriał: 100% poliester\nWymiary:\n\nDługość: 70 cm\nSzerokość: 33 cm\nWysokość: 33 cm\nPojemność: 75 l','','torba-sportowa-empoli','','','','Torba sportowa Empoli','','','',''),
