(135,1,1,'Profesjonalna torba treningowa Fiorentina\nProfesjonalna torba sportowa KEEZA Sports wykonana ze wzmacnianego poliestru. Duża pojemność, dodatkowe przegrody oraz komfort w użytkowaniu sprawiają, że torba nadaje się zarówno dla sportowców, jak i turystów.\nTorba sportowa KEEZA Sports to również wpisujący się w najnowsze trendy sportowe model. Nowoczesna linia, duża pakowność i wygoda to znaki rozpoznawcze naszej torby. Zamów już dziś w sklepie KEEZA.\nParametry:\n\nPojemna i przestronna komora główna zamykana na dwukierunkowy suwak\nWewnątrz komory głównej mała kieszonka na telefon lub portfel\nWyściełany, wygodny pas na ramię z możliwością odpięcia\nDodatkowe, wyściełane górne uszy\nWzmocnione dno\nPrzednia kieszeń (np. na buty) z siatką zapewniającą wentylację\nPierwsza boczna kieszeń (np. na brudne rzeczy) z siatką zapewniającą wentylację\nDruga boczna kieszeń podzielona na dwie przegrody z siatki umożliwiająca przechowywanie drobnych rzeczy\n\nWymiary:\n\nDługość 50 cm\nWysokość 30 cm\nSzerokość 26 cm\nPojemność ok. 40 litrów\n100% poliester','','torba-treningowa-fiorentina','','','','Torba treningowa Fiorentina','','','',''),
