(136,1,1,'Torba treningowa model Lazio\nTorba Lazio od KEEZA wykonana jest ze wzmocnionego poliestru odpornego na czynniki atmosferyczne, jak wiatr, deszcz, czy śnieg. Posiada pojemną komorę główną zamykaną na dwukierunkowy suwak. Druga kieszeń znajduje się w podstawie torby i również zamykana jest na suwak. Z przodu torby – mała kieszeń na drobne rzeczy. Torba Lazio posiada dwa wytrzymałe ucha oraz wygodny pas na ramię.\nMateriał: 100% poliester\nWymiary:Długość: 50 cmSzerokość: 30 cmWysokość: 35 cmPojemność: 50 l','','torba-treningowa-lazio','','','','Torba treningowa Lazio','','','',''),
