(140,1,1,'Czapka bawełniana KEEZA\nCzapka bawełniana z logiem KEEZA. Wykonana z miękkiego i przyjemnego w dotyku materiału. Czapka doskonale chroni przed wiatrem i niską temperaturą. Trwałość materiałów zapewnia długą żywotność produktu.\nSkład:\n\n92% bawełna\n8% elastan','','czapka-bawelniana-keeza','','','','Czapka bawełniana KEEZA','','','',''),
