(141,1,1,'Rozpinana bluza z kapturem HAGI\nBluza z kieszeniami typu kangurka przedzielonymi suwakiem. Bluza posiada kaptur, ściągacze w pasie i na rękawach.\nMateriał: \n\n100% poliester\npodszewka - polar\ngramatura 300 g\n\nBluza z kapturem wykonana z poliestru to bardzo popularny rodzaj odzieży sportowej, który zapewnia wygodę i komfort podczas uprawiania różnego rodzaju aktywności fizycznych. Poliester, jako materiał, charakteryzuje się wysoką odpornością na rozciąganie i zużycie oraz jest łatwy do czyszczenia i szybko schnie. Bluza Hagi wykonana jest lekka i przewiewna, co sprawia, że świetnie sprawdza się podczas treningów i uprawiania sportów. Dodatkowo, poliester doskonale odprowadza wilgoć z ciała na zewnątrz, dzięki czemu skóra pozostaje sucha, dając poczucie komfortu podczas intensywnego wysiłku fizycznego.\nProdukt jest również bardzo trwały i odporny na uszkodzenia mechaniczne, co oznacza, że można go nosić przez wiele sezonów. Jest on również łatwy w pielęgnacji i nie wymaga specjalnych zabiegów konserwacyjnych. Kaptur w bluzie z poliestru zapewnia dodatkową ochronę przed wiatrem i chłodem, co sprawia, że jest to idealna odzież dla osób uprawiających sporty na zewnątrz, zwłaszcza w czasie jesieni i zimy. Kieszenie zaś pozwalają na przechowywanie kluczy, telefonu i innych drobiazgów podczas aktywności fizycznej.','','bluza-sportowa-z-kapturem-hagi','','','','Bluza sportowa z kapturem Hagi','','','',''),
(141,1,2,'','','','','','','','','','',''),
(142,1,1,'Termoaktywna bluza ze stójką Lima\nElastyczna bluza z krótkim suwakiem i stójką. Bluza treningowa, zapewniająca odpowiednią termoizolację ciała. Znakomicie nadaje się do treningów zarówno zimą, jak i latem. Elastyczny, poliestrowy materiał zadba o komfort termiczny użytkownika. Bluza z długim rękawem, z otworem na kciuk. Produkt idealnie przylega do ciała, nie posiada kieszeni.\nBluza termoaktywna jest także niezbędną częścią garderoby podczas pieszych i górskich wycieczek, joggingu itd.\nMateriał: \n\n90% poliester\n10% spandex\ngramatura 230g\n\nBluza termoaktywna służy do ochrony ciała przed utratą ciepła w czasie wysiłku fizycznego. W przeciwieństwie do zwykłych bluz, które mogą powodować nadmierną potliwość i dyskomfort, bluza termoaktywna zapewnia skuteczne odprowadzanie wilgoci z ciała na zewnątrz, dzięki czemu skóra pozostaje sucha. Bluza Lima wykonana jest z wysokiej jakości materiałów, które posiadają zdolności termoaktywne. Oznacza to, że w zależności od warunków atmosferycznych oraz intensywności wysiłku fizycznego, materiał jest w stanie regulować temperaturę ciała. W chłodne dni bluza termoaktywna zatrzymuje ciepło w pobliżu ciała, a w gorące dni pomaga w szybkim odprowadzeniu nadmiaru ciepła na zewnątrz.\nBluza termoaktywna Lima są również wyposażona w specjalne właściwości antybakteryjne i antyodorowe, co zapobiega powstawaniu przykrego zapachu w wyniku nadmiernej potliwości. Produkt dostępny jest w różnych rozmiarach, dzięki czemu każdy może znaleźć model odpowiadający swoim potrzebom. Są one doskonałym wyborem dla osób, które uprawiają różnego rodzaju aktywności fizyczne, takie jak gra w piłkę nożną, bieganie, jazda na rowerze, fitness czy trekking.','','bluza-termoaktywna-lima','','','','Bluza termoaktywna Lima','','','',''),
