(156,1,1,'Spodnie treningowe, model CONTE, KEEZA Elite\nSpodnie, treningowe wykonane z elastycznego materiału, który podczas aktywności fizycznej zapewnia optymalną wentylację dzięki strukturze #ActiveVentilation. Model CONTE (slim fit) świetnie dopasowuje się do ciała użytkownika i pozwala w pełni skupić się na treningu.\nSpodnie posiadają dwie boczne kieszenie zamykane na suwak, sznurki w pasie do regulacji obwodu oraz zwężane nogawki. Charakterystyczne dla linii #KEEZAElite dwa boczne pasy na nogawkach w kontrastowym kolorze nadają modelowi CONTE sportowego stylu.\nHaftowany sygnet „e” umieszczony na spodniach idealnie współgra z ich kolorystyką.','','spodnie-treningowe-conte','','','','Spodnie treningowe Conte','','','',''),
