(162,1,1,'Komplety sublimowane \nChcesz zamówić niepowtarzalne stroje dla Swojej drużyny? Masz pomysł na wygląd koszulek, ale nie masz projektu? Skontaktuj się z nami. Nasi graficy wykonają dla Ciebie darmową wizualizację wg Twoich wytycznych.\nW skład kompletu sublimowanego wchodzą:\n\nKoszulka poliestrowa (dowolny nadruk i kolor) - model Oxford\nSpodenki poliestrowe - model Tottenham\nGetry piłkarskie\n\nKoszulka może mieć dowolny wzór, który ogranicza wyłącznie wyobraźnia naszych Klientów. \nCena za jeden komplet 120 zł. Minimalne zamówienie - 20 kompletów.\nMasz pytania? Zadzwoń: + 48 602 680 365 lub napisz: info@keeza.pl','','komplety-sublimowane','','','','Komplety sublimowane','','','',''),
(162,1,2,'','','','','','','','','','',''),
(163,1,1,'Koszulka Polo, model BEST, KEEZA Elite\nKoszulka wykonana z wysokiej jakości sprężystej dzianiny poliestrowej. Materiał zapewnia odporność na działanie promieni słonecznych, znakomicie pochłania i odprowadza wilgoć, co w przypadku odzieży sportowej ma niebagatelne znaczenie. Dzianina wykonana w technologii #SuperSoft nie uczula, jest bardzo wytrzymała i zarazem niezwykle wygodna.\n \n\n\nPolo BEST, podobnie jak cała kolekcja KEEZA Elite, posiada charakterystyczne białe wstawki wzdłuż prawego oraz w poprzek lewego rękawka.\n\n\nLogo KEEZA umieszczone na koszulce wykonane jest z gumy silikonowej. Nie przebija na drugą stronę. Jest wytrzymałe, a swoim designem idealnie pasuje do najnowszej kolekcji marki.\n \nMateriał: 100% poliester\n \nKoszulka polo to niezwykle elegancka i stylowa część garderoby, która zawsze cieszy się dużą popularnością wśród mężczyzn. Jest to uniwersalny element ubioru, który doskonale sprawdza się w wielu sytuacjach. Koszulka polo to w zasadzie połączenie koszuli i t-shirtu - ma kołnierzyk oraz krótkie rękawy, ale nie jest tak formalna jak koszula, a jednocześnie bardziej elegancka niż t-shirt. To właśnie ta hybryda sprawia, że koszulka polo jest tak chętnie wybierana przez mężczyzn, a także kobiety na całym świecie.\n\nW naszej ofercie znajdziesz koszulki polo z krótkim rękawem w różnych wersjach kolorystycznych i rozmiarach, co pozwala na dopasowanie ich do indywidualnych potrzeb i stylu. Nasze koszulki polo są wykonane z najwyższej jakości poliestru. Dzięki temu są nie tylko bardzo wygodne i komfortowe w noszeniu, ale także trwałe i odporne na uszkodzenia.\nKoszulka polo to doskonały wybór na co dzień, do pracy, na spotkania biznesowe czy formalne okazje. Można ją zestawić ze spodniami dresowymi, jeansami, chinosami czy spodniami w kant, a także podpiąć pod marynarkę lub sweter. Dzięki temu, że koszulki polo są dostępne w wielu kolorach i wersjach, każdy mężczyzna może znaleźć coś dla siebie i dopasować koszulkę do swojego stylu.\nZachęcamy do zapoznania się z naszą ofertą koszulek polo i wybrania modelu, który najlepiej spełni Twoje oczekiwania. Daj się skusić nie tylko na wygodę i komfort, ale także na elegancki i stylowy wygląd. Kupując u nas, masz pewność, że otrzymasz produkt najwyższej jakości, który będzie Ci służył przez wiele sezonów.','','koszulka-polo-best','','','','Koszulka Polo Best','','','',''),
(163,1,2,'','','','','','','','','','',''),
(164,1,1,'T-shirt bawełniany KEEZA\nCharakterystyczny t-shirt marki KEEZA z nadrukiem na klatce piersiowej.\n\nBrak bocznych szwów\nPodwójne szwy na ramionach\nŚciągacz wzmocniony lycrą\n100% stabilizowana bawełna\nGramatura: 190g\n\nSprawdź komplet treningowy KEEZA (koszulka, spodenki, getry) za jedyne 49 zł (klik).','','koszulka-bawelniana-keeza','','','','Koszulka bawełniana KEEZA','','','',''),
(164,1,2,'','','','','','','','','','',''),
(165,1,1,'T-shirt bawełniany KEEZA\nCharakterystyczny t-shirt marki KEEZA z nadrukiem na klatce piersiowej. Klasyczna dzianina bawełniana, dobrze układająca się na ciele. Bawełniana koszulka keeza nadaje się zarówno do uzupełnienia codziennej stylizacji, jak i do treningu.\n\nBrak bocznych szwów\nPodwójne szwy na ramionach\nŚciągacz wzmocniony lycrą\n100% stabilizowana bawełna\nGramatura: 190g\n\nSprawdź komplet treningowy KEEZA (koszulka, spodenki, getry) za jedyne 63,5 zł (klik).\nKoszulki bawełniane to ubrania wykonane z naturalnego materiału - bawełny. Charakteryzują się one miękkością, przewiewnością oraz łatwością w praniu. Mogą być produkowane w różnych kolorach, fasonach oraz z nadrukami. Są popularnym wyborem na co dzień oraz do różnych aktywności sportowych.\nKoszulki bawełniane to niezwykle popularny rodzaj odzieży, który znajduje zastosowanie w wielu dziedzinach życia. Są one miękkie, przewiewne i łatwe w praniu, co sprawia, że są bardzo wygodne w noszeniu. W poniższym artykule omówimy najważniejsze cechy koszulek bawełnianych, ich rodzaje oraz sposoby pielęgnacji.\nBawełna\nKoszulki bawełniane są wykonane z naturalnego materiału, jakim jest bawełna. Bawełna jest jednym z najpopularniejszych materiałów, których używa się w przemyśle tekstylnym. Charakteryzuje się ona miękkością, przewiewnością i łatwością w praniu. W zależności od jakości wykorzystanego surowca, koszulki bawełniane mogą mieć różne właściwości, np. być bardziej lub mniej odpornymi na rozciąganie czy zużycie.\nRodzaje koszulek bawełnianych\nKoszulki bawełniane występują w wielu wariantach, różniących się między innymi fasonem, kolorem, wzorem czy krójem. Najpopularniejsze są koszulki z krótkim rękawem, ale można także spotkać modele z długim rękawem, bez rękawów czy z kapturem. W zależności od stylu, w jakim są zaprojektowane, koszulki bawełniane mogą być idealne zarówno na co dzień, jak i na specjalne okazje.\nPielęgnacja koszulek bawełnianych\nKoszulki bawełniane należy prać w temperaturze maksymalnie 40°C, aby uniknąć uszkodzenia tkaniny. Pranie w wyższej temperaturze może spowodować skurczenie się tkaniny lub jej deformację. Warto pamiętać, że bawełna jest wrażliwa na środki chemiczne, dlatego należy unikać stosowania wybielaczy oraz płynów zmiękczających tkaniny. Koszulki bawełniane powinny być suszone w miejscu dobrze wentylowanym, a nie na słońcu lub w suszarce bębnowej.\nZastosowanie koszulek bawełnianych\nKoszulki bawełniane są bardzo uniwersalnym rodzajem odzieży, który można nosić w wielu sytuacjach. Mogą być noszone na co dzień, w pracy, na wakacjach, na imprezie czy podczas uprawiania sportu. W zależności od stylu, w jakim są zaprojektowane, koszulki bawełniane mogą być eleganckie, sportowe lub casualowe. Warto pamiętać, że dobór odpowiedniego modelu koszulki bawełnianej powinien być dostosowany do sytuacji, w której będzie ona noszona.','','koszulka-bawelniana-keeza','','','','Koszulka bawełniana KEEZA','','','',''),
(165,1,2,'','','','','','','','','','',''),
(166,1,1,'Koszulka piłkarska sublimowana Dover\nKoszulka piłkarska wykonana z najwyższej jakości poliestru o fakturze drobnej łezki. Materiał na bokach t-shirtu zastąpiony jest przewiewną białą siatką wykonaną w technologii SPEED-DRY, która gwarantuje komfort w trakcie wysiłku fizycznego. \nTrykot jest sublimowany. Kołnierzyk posiada atrakcyjną białą wstawkę.\nMateriał: 100% poliester','','koszulka-pilkarska-dover','','','','Koszulka piłkarska Dover','','','',''),
(166,1,2,'','','','','','','','','','',''),
(167,1,1,'T-shirt piłkarski Tottenham\nKoszulka sportowa Tottenham wykonana jest z najwyższej jakości termoaktywnej dzianiny poliestrowej. Posiada specjalistyczną siatkę umiejscowioną w newralgicznych miejscach. Zapewnia ona swobodną cyrkulację powietrza, co jest niezbędne podczas intensywnego wysiłku fizycznego. Kontrastowe wstawki oraz trójkątny dekolt (v-neck) tworzą elegancki design modelu Tottenham.\nZaawansowany technologicznie t-shirt Tottenham przeznaczony jest dla sportowców, dla których komfort połączony z profesjonalizmem to niezbędny zestaw, by osiągnąć sukces.\nMateriał: 100% poliester','','koszulka-pilkarska-tottenham','','','','Koszulka piłkarska Tottenham','','','',''),
(167,1,2,'','','','','','','','','','',''),
(168,1,1,'Koszulka polo model Derby\nPolo wykonana ze specjalnej termoaktywnej dzianiny sportowej, gwarantującej bardzo dobry przepływ powietrza i wilgoci. Elegancki design zapewnia codzienny komfort użytkowania. Nowoczesny krój idealnie wpasowuje się w najnowsze trendy modowe.\nMateriał: 100% poliester\nKoszulka polo to klasyk wśród męskiej garderoby, który nigdy nie wychodzi z mody. Wykonana z wysokiej jakości materiałów, gwarantuje wygodę i komfort noszenia, a jednocześnie prezentuje się bardzo stylowo. W naszej ofercie znajdziesz koszulki polo w różnych kolorach i rozmiarach, co pozwala na dopasowanie ich do indywidualnych preferencji i potrzeb. \nIdealna do noszenia na co dzień, do pracy czy na nieco bardziej formalne okazje. Kupując u nas, masz pewność, że otrzymasz produkt najwyższej jakości, który posłuży Ci przez wiele sezonów.','','koszulka-polo-derby','','','','Koszulka polo Derby','','','',''),
(168,1,2,'','','','','','','','','','',''),
(169,1,1,'Koszulka z krótkim rękawem Kingstone\nKlasyczna poliestrowa koszulka treningowa z krótkim rękawem. \n\nPoliester: 100%\nGramatura: 150 g\n\nPoliester, jako popularny materiał stosowany w odzieży sportowej, charakteryzuje się znakomitą przewiewnością. Dzięki swojej strukturze mikroskopijnych włókien, poliester umożliwia efektywną cyrkulację powietrza, co jest niezwykle istotne podczas aktywności fizycznej, takiej jak trening.\nKoszulki wykonane z poliestru stanowią doskonały wybór dla osób uprawiających różnorodne formy aktywności fizycznej. Ich właściwości przewiewne pomagają regulować temperaturę ciała, utrzymując uczucie świeżości i komfortu nawet podczas intensywnego wysiłku. Dzięki tej cech, odzież poliestrowa minimalizuje efekt przegrzewania się oraz nadmiernego pocenia, co wpływa pozytywnie na wydajność treningu.\nWarto zauważyć, że dzisiejsze technologie produkcji umożliwiają projektowanie koszulek poliestrowych z jeszcze lepszą przewiewnością, co przekłada się na jeszcze większy komfort użytkowania podczas aktywności sportowej. Dlatego koszulki z poliestru są często preferowanym wyborem dla sportowców i amatorów fitnessu, chcących osiągnąć najlepsze rezultaty bez utraty komfortu podczas treningu.','','koszulka-treningowa-kingston','','','','Koszulka treningowa Kingston','','','',''),
(169,1,2,'','','','','','','','','','',''),
(170,1,1,'Koszulka treningowa, model London\nKoszulka treningowa London to idealny wybór dla wymagających sportowców. T-shirt wykonany z najwyższej jakości poliestru. Oddychający materiał zapewnia komfort w trakcie wysiłku fizycznego. Koszulka odprowadza wilgoć na zewnątrz. Koszulka treningowa LONDON została zaprojektowana zarówno dla amatorów sportu, jak i dla profesjonalistów.\nProsimy o dokładne sprawdzenie rozmiarów według tabeli.\nDzianina: 100% poliester\n \n\nPoszukujesz wytrzymałej i funkcjonalnej koszulki do treningów lub codziennych aktywności? Nasza koszulka poliestrowa to idealne rozwiązanie dla Ciebie! Wykonana z wysokiej jakości materiału, który gwarantuje oddychalność i szybkie schnięcie, dzięki czemu zawsze będziesz czuł się komfortowo. Dodatkowo, nasza koszulka poliestrowa ma doskonałą jakość druku, co pozwoli Ci wyrazić swoją indywidualność. Dostępna w różnych rozmiarach i kolorach, z pewnością znajdziesz model idealnie dopasowany do swoich potrzeb. Zamów już teraz i ciesz się wygodą i stylowym wyglądem!','','koszulka-treningowa-london','','','','Koszulka treningowa London','','','',''),
(170,1,2,'','','','','','','','','','',''),
(171,1,1,'Kurtka ortalionowa model Crespo\nRozpinana kurtka ortalionowa z podszewką, z profilowanym, chowanym kapturem o klejonych szwach. \nWykonana z wysokiej jakości dzianiny poliestrowej gwarantującej ochronę przed niesprzyjającymi czynnikami atmosferycznymi #TechProof. Model CRESPO posiada regulowany ściągaczami kaptur oraz dół kurtki. Dwie boczne kieszenie zamykane są na suwak, rękawy wykończone ściągaczem. \nDzięki podszewce z drobnej siateczki, kurtka świetnie chroni nie tylko przed deszczem, ale i wiatrem oraz niską temperaturą. Kurtka CRESPO podobnie jak cała kolekcja KEEZA Elite, posiada charakterystyczne białe wstawki wzdłuż prawego oraz w poprzek lewego rękawa.\nDzianina: 100% poliester z oddychającą siatką.','','kurtka-ortalionowa-crespo','','','','Kurtka ortalionowa Crespo','','','',''),
(171,1,2,'','','','','','','','','','',''),
(172,1,1,'Kurtka przeciwdeszczowa Mensa\nKurtka ortalionowa z podszewką - połączenie stylu i funkcjonalności w jednym. Chroni przed wiatrem, deszczem i chłodem dzięki dodatkowej wyściółce, zachowując jednocześnie komfort noszenia. Doskonała na zmienne warunki pogodowe, stanie się niezastąpionym elementem twojej garderoby. Elegancja spotyka praktyczność!\n\ndwie boczne kieszenie zapinane na suwak\nściągacze u dołu kurtki\nchowany kaptur z sygnowanymi sznurkami do regulacji\npodszewka z siatki\nzewnętrzna warstwa z hydrofobową impregnacją ma właściwości hydrofobowe oraz zapewnia ochronę przed wiatrem i deszczem\npodszewka z mikrosiatki o gramaturze 190g\n100% poliester','','kurtka-ortalionowa-mensa','','','','Kurtka ortalionowa Mensa','','','',''),
