(173,1,1,'Kurtka zimowa pikowana, model Vienna\nKurtka Vienna wykonana jest z najwyższej jakości materiałów. Jej sportowy design znakomicie wpisuje się w najnowsze trendy modowe.  \nZimowa kurtka Vienna posiada odpinany kaptur, dwie kieszenie zewnętrzne oraz kieszeń wewnętrzną.\nMateriał: 100% poliester','','kurtka-zimowa-vienna','','','','Kurtka zimowa Vienna','','','',''),
