(174,1,1,'Damskie legginsy - stripes\nTermoaktywne legginsy to wyjątkowy model niekrępujący ruchów, wykonany z materiału, który porusza się wraz z ciałem wspomagając twój trening.Miękka, komfortowa dzianina termoaktywna keeza FIT, z której wykonaliśmy legginsy jest gwarancją wygody oraz pewności podczas każdej aktywności sportowej.\n\n100% poliester 230 g (dzianina termoaktywna z elastanem)\nMateriał odprowadza wilgoć na zewnątrz\nOgraniczona liczba szwów zapobiega otarciom i odparzeniom nawet podczas nawet najbardziej intensywnych treningów','','legginsy-damskie','','','','Legginsy damskie','','','',''),
