(175,1,1,'Komplet termoaktywny Bristol\nPodkoszulka + spodenki \nPodkoszulka termoaktywna z długim rękawem i okrągłym dekoltem oraz spodenki zapewniają właściwy mikroklimat dla skóry. Są komfortowe w użytkowaniu.\nBielizna tarmoaktywna pomaga w utrzymaniu stałej, komfortowej temperatury ciała. Jest zatem idealnym rozwiązaniem zarówno na upały, jak i zimowe, ujemne temperatury. Produkt cechuje się rewelacyjną termoizolacją. To niezwykle komfortowe rozwiązanie dla osób intensywnie uprawiających każdą dyscyplinę sportu.\nBielizna termoaktywna świetnie odprowadza wilgoć na zewnątrz, dzięki czemu reguluje temperaturę ciała. Testowana w bardzo trudnych warunkach atmosferycznych.\nMateriał: 100% poliester\n\nSprawdź czapki bawełniane z dodatkiem elastanu w super cenie!','','komplet-termoaktywny-z-dlugim-rekawem','','','','Komplet termoaktywny z długim rękawem','','','',''),
