(178,1,1,'Bielizna termoaktywna, koszulka z krótkim rękawem Bristol\nPodkoszulka termoaktywna, model  z krótkim rękawem posiada okrągły dekolt oraz obcisłą strukturę. Zapewnia właściwy mikroklimat dla skóry. Jest komfortowa w użytkowaniu.\nBielizna tarmoaktywna pomaga w utrzymaniu stałej, komfortowej temperatury ciała. Jest zatem idealnym rozwiązaniem zarówno na upały, jak i zimowe, ujemne temperatury. \nOdzież Bristol KEEZA cechuje się rewelacyjną termoizolacją. To niezwykle komfortowe rozwiązanie dla osób intensywnie uprawiających każdą dyscyplinę sportu.\nBielizna termoaktywna świetnie odprowadza wilgoć na zewnątrz, dzięki czemu reguluje temperaturę ciała. Testowana w bardzo trudnych warunkach atmosferycznych.\nMateriał: 100% poliester','','koszulka-termoaktywna-z-krotkim-rekawem-bristol','','','','Koszulka termoaktywna z krótkim rękawem Bristol','','','',''),
