(180,1,1,'Skarpetki stopki\nStopki z dwoma panelami wentylującymi na śródstopiu zrobione miękkiej oraz delikatnej bawełny. Skarpetka posiada elastyczny ściągacz na środku, dzięki czemu nie przesuwa się na stopie. Dodatkowym atutem stopek są języczki, które ułatwiają wsuwanie ich na stopę.\nCechy sportowych stopek KEEZA:\n\nodprowadzanie wilgoci na zewnątrz\nwentylacja stopy\nkomfort użytkowania\n\nMateriał:\n\n80% bawełna\n15% Poliamid\n5% Elastan','','skarpetki-stopki-biale-trojpak','','','','Skarpetki stopki białe TRÓJPAK','','','',''),
