(183,1,1,'Skarpetki stopki frotte - 3 pary\nStopki z dwoma panelami wentylującymi na śródstopiu i charakterystyczną szachownicą z miękkiej froty na podeszwie. Stopki zapewniają lepszą stabilizację stopy w bucie. Zapewniają komfort podczas chodzenia. Skarpetka posiada elastyczny ściągacz na środku, dzięki czemu nie przesuwa się na stopie. Ten model stopki ma długość do kostki.\nCechy sportowych stopek KEEZA:\n\nochronne frotte na podeszwie\nodprowadzanie wilgoci na zewnątrz\nwentylacja stopy\nkomfort użytkowania\n\nMateriał:\n\nProlen siltex 50%\nBawełna 35%\nElastan 10%\nLycra 5%','','skarpetki-stopki-frotte-trojpak','','','','Skarpetki stopki frotte TRÓJPAK','','','',''),
