(197,1,1,'Skarpety sportowe-dwustrefowe KEEZA\nSkarpety sportowe z dwiema strefami wentylacyjnymi. Wykonane z niezwykle miękkich materiałów. Miękka podeszwa oraz wentylowane panele na podbiciu sprawiają, że skarpetki nadają się zarówno do uprawiania wszelkiego rodzaju aktywności fizycznej, jak i do chodzenia na co dzień. \nWykonana z siatkowego splotu włókien siatka na skarpecie wentyluje i odprowadza wilgoć na zewnątrz. Ściągacz na śródstopiu zapewnia stabilizację stopy. \nMateriał:\n\nProlen siltex 50%\nBawełna 35%\nElastan 10%\nLycra 5%','','skarpety-sportowe-strefowe','','','','Skarpety sportowe strefowe','','','',''),
(197,1,2,'','','','','','','','','','',''),
(198,1,1,'Skarpety sportowe KEEZA\nSkarpety sportowe, wykonane z bawełny najwyższej jakości. Sprawdzają się doskonale podczas ćwiczeń jak i do noszenia na co dzień.\nPosiadają elastyczny ściągacz, który nie pozwala na zsuwanie się skarpety z nogi, a dodatkowy ściągacz na śródstopiu stabilizuje skarpetę w bucie. Siatki wentylacyjne na górze stopy umożliwiają lepsze odprowadzanie wilgoci.\nW wielopakach wychodzi taniej!\n3 pary skarpet KEEZA (klik)10 par skarpet KEEZA (klik)\nMateriał:\n\n80% bawełna\n15% Poliamid\n5% Elastan\n\nNie jesteśmy dystrybutorem skarpet. Nie sprowadzamy ich z zagranicy. Jesteśmy producentem. Nasze skarpety produkowane są w naszej polskiej fabryce. Wszystkie materiały pochodzą z Polski. Gwarantujemy, że przykładamy dużą wagę do jakości naszych wyrobów. Produkcję kontrolujemy od samego początku, czyli od doboru nici do wysłania skarpet do Klienta. \nW KEEZA wykonujemy także skarpety sportowe na zamówienie. Wykonujemy skarpety z logo dla klubów sportowych, agencji reklamowych, klientów indywidualnych itd. Wizualizację skarpet Twojego pomysłu wykonamy całkowicie gratis. Wystarczy, że skontaktujesz się z nami drogą mailową: info@keeza.pl.','','skarpety-sportowe','','','','Skarpety sportowe','','','',''),
(198,1,2,'','','','','','','','','','',''),
(199,1,1,'Spodenki krótkie, model NESTA, KEEZA Elite\nSpodenki wykonane z miękkiej i miłej w dotyku dzianiny. Rozciągliwy materiał płynnie podąża za ruchami sportowca.\nSpodenki NESTA posiadają dwie boczne kieszenie zamykane na suwak, sznurki w pasie do regulacji obwodu oraz wentylowane wstawki #SportBreathingTechnology zapewniające komfort podczas nawet najbardziej intensywnego wysiłku fizycznego.\nHaftowany sygnet „e\" umieszczony na spodniach idealnie współgra z ich kolorystyką.\nMateriał: 100% poliester','','krotkie-spodenki-nesta','','','','Krótkie spodenki Nesta','','','',''),
