(219,1,1,'Dresy sportowe Birmingham\nDresy sportowo-reprezentacyjne wykonane z miękkiego i elastycznego poliestru klasy premium. Bluza posiada wysoki kołnierz i krótki suwak, zapewniający komfort podczas zakładania. Rękawy zaś wykończone są ściągaczem. Spodnie Birmingham z indywidualną regulacją w pasie i krótkim suwakiem w nogawkach gwarantują wygodę, zachowując przy tym sportowy charakter. \nMateriał wykonany w technologii SuperSoft jest nie tylko niezwykle miękki i delikatny w kontakcie ze skórą, ale wyróżnia go również wysoka wytrzymałość.\nDzianina: 100% poliester','','komplet-dresowy-birmingham-ap-blonianka-blonie','','','','Komplet dresowy Birmingham AP Błonianka Błonie','','','',''),
