(263,1,1,'Komplet meczowy, biały - Akademia GKS Bełchatów\nElementami charakterystycznymi koszulki GKS Bełchatów są: grafika koła czerpakowego koparki wykorzystywanej w górnictwie odkrywkowym oraz mankiety w dwóch kolorach (zielonym i czarnym). Koszulka w białym kolorze z poziomym, zielonoczarnym pasem na środku. W dolnej części koszulki widnieje hasło \"Duma górniczego miasta\". Na karku zaś data założenia klubu. Na przedzie trykotu obok logo KEEZA i herbu Klubu znajduje się logotyp miasta Bełchatowa. \nTermoaktywna koszulka sportowa wykonana z najwyższej jakości przędzy mikrofilamentowej. Dzięki zastosowaniu nowoczesnych technologii, koszulka (model Liverpool) doskonale odprowadza wilgoć z powierzchni skóry na zewnątrz. Dzianina poliestrowa zapewnia elastyczność produktu, dzięki czemu idealnie dopasowuje się do każdej sylwetki. Fason koszulki gwarantuje wygodę i nie krępuje ruchów, co jest szczególnie istotne w sportach kontaktowych.Dzianina: 100% poliester, 140 g\nNadruk: Dowolny numer na plecach.\nSpodenki sportowe, model Tottenham, wykonane z najwyższej jakości termoaktywnej dzianiny poliestrowej. Materiał zapewnia przewiewność, suchość i poczucie komfortu. Model posiada regulację obwodu w pasie. Jest idealnym rozwiązaniem dla wymagających sportowców.\nZaawansowane technologicznie spodenki przeznaczone są dla sportowców, dla których komfort połączony z profesjonalizmem to niezbędny zestaw, by osiągnąć sukces.\nDzianina: 100% poliesterGetry sportowe wykonane z profesjonalnej dzianiny termoaktywnej zapewniającej przewiewność, suchość i poczucie komfortu w użytkowaniu. Getry posiadają kilka stref wentylacji.\nRozmiary: 33/35, 36/38, 39/42, 43/46Dzianina: bawełna, poliamid, elastan\nKomplet nie zawiera butów.\n* termin realizacji personalizowanej koszulki wynosi ok. 21 dni roboczych\n*produkt nieprefabrykowany','','komplet-meczowy-bialy-akademia-gks-belchatow','','','','Komplet meczowy biały Akademia GKS Bełchatów','','','',''),
