(264,1,1,'Koszulka meczowa - domowa Pogoń Lwów na sezon 2020/2021\nLegendarna Pogoń Lwów to klub, którego nie trzeba nikomu przedstawiać. Jego historia sięga 1904 roku. Pogoń Lwów to:\n\n4 krotny mistrz Polski w piłce nożnej (1922, 1923, 1925, 1926)\n3 krotny wicemistrz Polski w piłce nożnej (1932, 1933, 1935)\nWicemistrz Polski Juniorów w piłce nożnej (1937) \n\nKoszulka domowa Pogoni Lwów ma poziome pasy w niebiesko-czerwonych barwach. U dołu trykotu w kontrastowym białym kolorze widnieje zarys lwowskich budynków. Na plecach zaś znajduje się rycerz na koniu znany z herbu klubu ze Lwowa.\nTermoaktywna koszulka sportowa wykonana z najwyższej jakości przędzy mikrofilamentowej. Dzięki zastosowaniu nowoczesnych technologii, koszulka Oxford doskonale odprowadza wilgoć z powierzchni skóry na zewnątrz. Dzianina poliestrowa zapewnia elastyczność produktu, dzięki czemu idealnie dopasowuje się do każdej sylwetki. Fason koszulki gwarantuje wygodę i nie krępuje ruchów, co jest szczególnie istotne w sportach kontaktowych.\nDzianina: 100% poliester, 140 g\nNadruk: Dowolny nadruk na plecach\n* termin realizacji personalizowanej koszulki wynosi ok. 30 dni roboczych\n*produkt nieprefabrykowany*produkt nieprefabrykowany','','koszulka-domowa-pogon-lwow','','','','Koszulka domowa Pogoń Lwów','','','',''),
