(267,1,1,'Torba sportowa, model Genoa, Pogoń Lwów\n\nTorba Genoa z herbem Pogoni Lwów - wykonana jest ze wzmocnionego poliestru odpornego na czynniki atmosferyczne, jak wiatr, deszcz, czy śnieg.\nPosiada pojemną komorę główną zamykaną na dwukierunkowy suwak. Druga kieszeń znajduje się w podstawie torby i również zamykana jest na suwak. Z przodu torby – mała kieszeń na drobne rzeczy. Produkt posiada dwa wytrzymałe ucha oraz wygodny pas na ramię.\n\npodwójne dno\nkomora na buty\ntrwały materiał\nmateriał: 100% poliester\n\nWymiary:\n\ngłębokość 32 cm\nwysokość 48 cm\nszerokość 54 cm\npojemność 80 litrów\n\nW tym komora:\n\nwysokość 11 cm\ndługość 46 cm\ngłębokość 25 cm','','torba-sportowa-genoa-pogon-lwow','','','','Torba sportowa Genoa Pogoń Lwów','','','',''),
