(273,1,1,'Torba Broń Radom\n\nTorba Genoa od KEEZA wykonana jest ze wzmocnionego poliestru odpornego na czynniki atmosferyczne, jak wiatr, deszcz, czy śnieg. \nPosiada pojemną komorę główną zamykaną na dwukierunkowy suwak. Druga kieszeń znajduje się w podstawie torby i również zamykana jest na suwak. Z przodu torby – mała kieszeń na drobne rzeczy. Torba Genoa posiada dwa wytrzymałe ucha oraz wygodny pas na ramię.\n\npodwójne dno\nkomora na buty (usztywnienie dodatkowo płatne)\ntrwały materiał\nmateriał: 100% poliester\n\nWymiary:\n\ngłębokość 32 cm\nwysokość 48 cm\nszerokość 54 cm\npojemność 80 litrów\n\nW tym komora:\n\nwysokość 11 cm\ndługość 46 cm\ngłębokość 25 cm','','torba-sportowa-bron-radom','','','','Torba sportowa Broń Radom','','','',''),
