(275,1,1,'Komplet dresowy Burton, Sokół Aleksandrów Łódzki\n\nwysokiej jakości poliestrowa dzianina niekrępująca ruchów\nbluza oraz zwężane przy nogawkach spodnie posiadają krótki suwak\nspodnie z bocznymi kieszeniami na drobne przedmioty\nkontrastowe wstawki\n\nMateriał: 100% poliester\nWarianty nadruku: folia flex, haft\nRozmiary: junior, senior','','komplet-dresowy-burton-sokol-aleksandrow','','','','Komplet dresowy Burton, Sokół Aleksandrów','','','',''),
