(280,1,1,'Bluza dresowa z krótkim suwakiem, model VIERI, Stomil Olsztyn\nBluza piłkarska ze stójką wykonana z elastycznego materiału dzianinowego odprowadzającego wilgoć na zewnątrz #SpeedDry. Jest bardzo wygodna i dopasowana do ciała (slim fit). Posiada ściągacze przy mankietach i u dołu bluzy oraz krótki suwak.\nBluza Vieri, podobnie jak cała kolekcja KEEZA Elite, posiada charakterystyczne białe wstawki wzdłuż prawego oraz w poprzek lewego rękawa.\nLogo KEEZA umieszczone na bluzie wykonane jest z gumy silikonowej. Nie przebija na drugą stronę. Jest wytrzymałe, a swoim designem idealnie pasuje do najnowszej kolekcji marki.\nMateriał: 100% poliester','','bluza-vieri-stomil-olsztyn','','','','Bluza Vieri Stomil Olsztyn','','','',''),
