(289,1,1,'T-shirt bawełniany KEEZA&amp;Stomil Olsztyn\nCharakterystyczny t-shirt marki KEEZA z herbem Stomilu Olsztyn oraz nadrukiem nałożonym metodą sitodruku na klatce piersiowej. Klasyczna dzianina bawełniana, dobrze układająca się na ciele. \n\nBrak bocznych szwów\nPodwójne szwy na ramionach\nŚciągacz wzmocniony lycrą\n100% stabilizowana bawełna\nGramatura: 190g','','koszulka-treningowa-stomil-olsztyn','','','','Koszulka treningowa Stomil Olsztyn','','','',''),
