(313,1,1,'OstroVit KEEZA After Pro Workout 500 g\nOstroVit KEEZA After Pro Workout to wysokiej jakości suplement diety, który zawiera idealną mieszankę składników aktywnych do stosowania po treningu. Jego zadaniem jest przede wszystkim regeneracja i pomoc w prawidłowym funkcjonowaniu mięśni, poprawa zdolności wysiłkowej i uzupełnienie utraconych składników po intensywnym wysiłku fizycznym. Jeśli często, intensywnie trenujesz i potrzebujesz systematycznej regeneracji - postaw na nasz wieloskładnikowy preparat OstroVit KEEZA After Pro Workout.\n\nWłaściwości składników zawartych w OstroVit KEEZA After Pro Workout:\n\nIDEALNE WSPARCIE PODCZAS TRENINGU - BCAA przyspieszają regenerację mięśni między treningami i chronią je podczas treningu, L-cytrulina w postaci jabłczanu zwiększa między innymi uczucie pompy mięśniowej, zaś obie formy kreatyny w postaci monohydratu i jabłczanu mają ogromny wpływ na zwiększenie naszej siły i wytrzymałości treningowej.\nDUŻA ILOŚĆ SKŁADNIKÓW AKTYWNYCH - Jedna porcja naszego suplementu to kompleksowy zestaw zawierający między innymi niezbędne aminokwasy BCAA, cytrulinę w postaci jabłczanu L-cytruliny, Beta-alaninę, glicynę, witaminę C, witaminy z grupy B, taurynę, potas, magnez, chlorek sodu.\nWYGODNA FORMA - Porcję naszej potreningówki wystarczy wymieszać z wodą lub sokiem i przyjąć po ukończonym treningu.\nOWOCOWY SMAK - Smak egzotycznej gumy balonowej to czysta przyjemność suplementacji.\n\nSprawdź, jakie składniki aktywne znajdują się w naszym suplemencie:\n\nBCAA - L-leucyna, L-izoleucyna i L-walina. Grupa niezbędnych rozgałęzionych aminokwasów egzogennych. Stanowią fundamentalny element diety potreningowej, uczestnicząc przede wszystkim w budowaniu i regeneracji mięśni oraz redukcji tkanki tłuszczowej. Zapotrzebowanie na nie wzrasta wraz ze wzrostem aktywności fizycznej.\nKreatyna - w postaci jabłczanu i monohydratu kreatyny. Jej głównym zadaniem jest gromadzenie energii w mięśniach, co wpływa na zwiększenie ilości energii, którą można wykorzystać w trakcie treningu. Zwiększona zawartość energii w mięśniach, prowadzi do wzrostu siły i wytrzymałości organizmu, a tym samym do regularnego wzrostu efektywności treningów. Dodatkowo poprawia wzrost beztłuszczowej masy ciała i siły mięśniowej oraz może zwiększać wydolność organizmu.\nL-cytrulina - w postaci jabłczanu L-cytruliny. Wykazuje działanie antyoksydacyjne, pomaga zwiększyć efekt \"pompy\" mięśniowej dzięki nasileniu syntezy tlenku azotu.\nL-glutamina. Aminokwas endogenny, którego suplementacja jest świetnym pomysłem przy ciężkich redukcjach tkanki mięśniowej, gdyż działa na nasze komórki antykatabolicznie.\nBeta-alanina. Wykazuje zdolność do buforowania mięśni, co powoduje opóźnienie zmęczenia podczas ćwiczeń o wysokiej intensywności.\nTauryna. Może wpływać na wydolność organizmu oraz zwiększać spalanie tłuszczu podczas aktywności, wspiera działanie mięśni, w tym mięśnia sercowego, hamuje procesy katabolizmu w mięśniach, wykazuje działanie neuroprotekcyjne.\nGlicyna. Aminokwas endogenny o silnych właściwościach antyoksydacyjnych, pełni także funkcję neuroprzekaźnika w ośrodkowym układzie nerwowym. Bierze udział w produkcji DNA, fosfolipidów i kolagenu, a także ma istotny wpływ podczas uwalniania ATP (adenozynotrójfosforanów), które zawierają wysokoenergetyczne wiązania niezbędne do prowadzenia wszystkich życiowych procesów.\nTiamina (witamina B1). Przyczynia się do utrzymania prawidłowego metabolizmu energetycznego oraz pomaga w prawidłowym funkcjonowaniu układu nerwowego.\nRyboflawina (witamina B2). Przyczynia się do utrzymania prawidłowego metabolizmu energetycznego, pomaga w prawidłowym funkcjonowaniu układu nerwowego. Dodatkowo witamina ta pomaga zachować zdrowy stan skóry i błon śluzowych.\nKwas pantotenowy (witamina B5). Przyczynia się do utrzymania prawidłowego metabolizmu energetycznego, a także pomaga w utrzymaniu prawidłowych funkcji psychologicznych. Pomaga zachować zdrowy stan skóry oraz przyczynia się do zmniejszenia uczucia zmęczenia i znużenia.\nWitamina B6. Spełnia oraz wspiera bardzo wiele funkcji fizjologicznych, jest kluczowa w poprawnym funkcjonowaniu wszystkich narządów w naszym organizmie.\nWitamina B12 (metylokobalamina). Metylokobalamina to najlepiej wchłanialna postać witaminy B12. Przyczynia się do utrzymania prawidłowego metabolizmu energetycznego oraz pomaga w prawidłowym funkcjonowaniu układu nerwowego, a także w utrzymaniu prawidłowego metabolizmu homocysteiny. Witamina ta odgrywa rolę w procesie podziału komórek.\nKwas foliowy (witamina B9). Bierze udział w procesie podziału komórek, pomaga w prawidłowej produkcji krwi oraz w utrzymaniu prawidłowego metabolizmu homocysteiny.\nBiotyna (witamina B7). Przyczynia się do utrzymania prawidłowego metabolizmu energetycznego, pomaga w prawidłowym funkcjonowaniu układu nerwowego. Biotyna pomaga także zachować zdrowy stan skóry, włosów i błon śluzowych.\nWitamina C. Jako kwas L-askorbinowy, jest niezbędnym składnikiem odżywczym w diecie człowieka. Odpowiada za prawidłowe funkcjonowanie tkanki łącznej oraz kości, uczestniczy w syntezie kolagenu. Jest silnym przeciwutleniaczem.\nMagnez. Wspomaga przemiany węglowodanowe, tłuszczowe i białkowe. Wspiera przewodnictwo nerwowe i układ krążenia.\nPotas. Pierwiastek mineralny biorący udział w utrzymaniu prawidłowej równowagi wodno-elektrolitowej organizmu. Przyczynia się do prawidłowego napięcia mięśni, wspiera znacząco pracę układu nerwowego i układu krążenia.\nChlorek sodu. Bierze udział w regulacji ciśnienia krwi, jego odpowiedni poziom zapobiega występowaniu skurczów mięśni i zapewnia lepsze nawodnienie organizmu.\n\nSposób użycia\n\nPorcję 20 g (3 miarki) wymieszać w 300-350 ml wody lub soku. Spożywać jedną porcję po treningu. Produkt jest przeznaczony dla osób o zwiększonej aktywności fizycznej.\nNie przekraczać zalecanej dziennej porcji do spożycia. Suplement diety nie może być stosowany jako substytut (zamiennik) zróżnicowanej diety. Zalecany jest zrównoważony sposób żywienia i zdrowy tryb życia. Nie spożywać w przypadku uczulenia na którykolwiek ze składników produktu. Produkt nie powinien być stosowany przez dzieci, kobiety w ciąży i matki karmiące. Przechowywać w sposób niedostępny dla małych dzieci. Przechowywać w temperaturze 15-25°C, w zamkniętym opakowaniu, w suchym miejscu. Chronić przed bezpośrednim działaniem promieni słonecznych.\n\nSkładniki\nMaltodekstryna, BCAA (L-leucyna, L-izoleucyna, L-walina, emulgator: lecytyny), jabłczan L-cytruliny, L-glutamina, monohydrat kreatyny, jabłczan kreatyny, tauryna, glicyna, cytrynian potasu (potas), beta-alanina, kwas L-askorbinowy (witamina C), chlorek sodu (sód, chlorek), sole magnezowe kwasu cytrynowego (magnez), aromaty, regulator kwasowości: kwas cytrynowy; substancja przeciwzbrylająca: dwutlenek krzemu; koncentrat soku z buraka w proszku, barwnik: karoteny; substancje słodzące: sukraloza, acesulfam K; chlorowodorek tiaminy (tiamina), ryboflawina (witamina B2), D-pantotenian wapnia (kwas pantotenowy), chlorowodorek pirydoksyny (witamina B6), kwas pteroilomonoglutaminowy (kwas foliowy), D-biotyna (biotyna), metylokobalamina (witamina B12).\nSuplement diety. Zawiera substancje słodzące.\nProdukt może zawierać mleko (łącznie z laktozą), soję, orzeszki ziemne, inne orzechy, nasiona sezamu, zboża zawierające gluten, jaja, skorupiaki, ryby.\n\n\nWartość odżywcza\n\nMasa netto produktu: 500 g\nIlość porcji w opakowaniu: 25\nWielkość porcji: 20 g\n\n\n\n\nSkładniki aktywne\nNa porcję 20 g\n% RWS*\n\n\nL-leucyna\n1250 mg\n-\n\n\nL-izoleucyna\n625 mg\n-\n\n\nL-walina\n625 mg\n-\n\n\nJabłczan L-cytruliny\n2000 mg\n-\n\n\n- w tym L-cytrulina\n1230 mg\n-\n\n\nL-glutamina\n1500 mg\n-\n\n\nMonohydrat kreatyny\n1450 mg\n-\n\n\n- w tym kreatyna\n1275 mg\n-\n\n\nJabłczan kreatyny\n1450 mg\n-\n\n\n- w tym kreatyna\n1088 mg\n-\n\n\nTauryna\n1000 mg\n-\n\n\nGlicyna\n1000 mg\n-\n\n\nBeta-alanina\n800 mg\n-\n\n\nWitamina C\n500 mg\n625%\n\n\nPotas\n300 mg\n15%\n\n\nSód\n195 mg\n-\n\n\nChlorek\n300 mg\n38%\n\n\nMagnez\n57 mg\n15%\n\n\nWitamina B12\n5 µg\n200%\n\n\nTiamina (witamina B1)\n7.5 mg\n682%\n\n\nRyboflawina (witamina B2)\n7.5 mg\n536%\n\n\nKwas pantotenowy (witamina B5)\n6 mg\n100%\n\n\nWitamina B6\n1 mg\n71%\n\n\nKwas foliowy (witamina B9)\n200 µg\n100%\n\n\nBiotyna (witamina B7)\n75 µg\n150%\n\n\n\n*RWS - Referencyjna wartość spożycia','','ostrovit-keeza-after-pro-workout-500-g-exotic-bubble-gum','','','','OstroVit KEEZA After Pro Workout 500 g exotic bubble gum','','','',''),
