(314,1,1,'OstroVit KEEZA Flex Aid 400 g\nOstroVit KEEZA Flex Aid jest zestawem jedenastu składników aktywnych w wygodnej do podania postaci proszku do rozpuszczania w wodzie. Składniki zawarte w naszym preparacie wspomagają pracę i regenerację stawów i kości. Utrzymanie ich w dobrej kondycji pozwala na bezpieczeństwo i skuteczność codziennych treningów. Dlatego też nasz suplementy diety OstroVit KEEZA Flex Aid polecany jest szczególnie osobom regularnie uprawiającym aktywność fizyczną, by mogły kompleksowo zadbać o swój narząd ruchu.\n\n20 porcji suplementu w postaci proszku do rozpuszczania w wodzie\n1 porcja = 3 miarki suplementu\nkompleksowe połączenie składników aktywnych\n\n[product id=\"269, 272, 268, 271, 270\" slider=\"true\"]\nWłaściwości składników zawartych w OstroVit KEEZA Flex Aid:\n\nOCHRONA i WZMOCNIENIE STAWÓW i KOŚCI – Składniki takie jak kolagen, siarczan chondroityny, kwas hialuronowy i kompleks witamin C, D3 i K2 bezpośrednio wpływają na sprawność kości i stawów.\nŁATWE STOSOWANIE – Idealny dla osób, które unikają suplementacji w postaci tabletek. Wystarczy raz dziennie rozpuścić 20 g naszego suplementu w 100-150 ml wody lub soku.\nOWOCOWY SMAK – Gruszkowo-limonkowy smak płynu sprawia, że regularna suplementacja to przyjemność.\n\nSprawdź, jakie działanie wykazują poszczególne składniki aktywne zawarte w suplemencie:\n\nHydrolizowany kolagen wołowy. W naszym preparacie w dawce aż 10 000 mg. Jego podstawową funkcją jest utrzymanie strukturalnej integralności tkanek i narządów, wiąże wodę w tkankach, jest bardzo istotny w procesach regeneracyjnych: gojeniu ran, tworzeniu blizn, zrastaniu się kości po złamaniach. Umożliwia lepsze wchłanianie składników mineralnych, zwiększając gęstość kości, wspiera procesy ochronne i naprawcze w tkance chrzęstnej.\nMetylosulfonylometan MSM. To organiczny związek siarki. Podobnie jak glukozamina, jest on często polecany w przypadku problemów ze stawami. Ponadto siarka uczestniczy również w syntezie kolagenu oraz keratyny. Substancje te niezbędne są dla zachowania mocnych i zdrowych włosów, skóry oraz paznokci.\nSiarczan glukozaminy 2KCl. Jest substancją stanowiącą budulec związków występujących w chrząstce stawowej. Suplementację poleca się w okresie wzmożonego wysiłku fizycznego i większego obciążenia stawów. Brak tej substancji sprawia, iż stawy nie wykonują swojej pracy jak należy.\nWapń. Jest potrzebny do utrzymania zdrowego stanu kości i zębów, a także pomaga w prawidłowym funkcjonowaniu mięśni. Wapń dodatkowo przyczynia się do prawidłowego krzepnięcia krwi oraz utrzymania prawidłowego metabolizmu energetycznego i prawidłowego przekaźnictwa nerwowego.\nWitamina C. Jako kwas L-askorbinowy, jest niezbędnym składnikiem odżywczym w diecie człowieka. Odpowiada za prawidłowe funkcjonowanie tkanki łącznej oraz kości, uczestniczy w syntezie kolagenu. Jest silnym przeciwutleniaczem.\nMagnez. Wspomaga przemiany węglowodanowe, tłuszczowe i białkowe. Wspiera przewodnictwo nerwowe i układ krążenia.\nSiarczan chondroityny. Bierze udział w eliminowaniu uczucia tarcia między powierzchniami stawowymi. Ponadto chondroityna w naturalny sposób wspomaga produkcję mazi stawowej, która odpowiedzialna jest za prawidłowe funkcjonowanie stawów. Dzięki temu ich struktura nie podlega zniszczeniu, a jakość wykonywanego ruchu jest nadal na prawidłowym poziomie.\nKwas hialuronowy. Jedną z najbardziej pożądanych zalet kwasu hialuronowego podczas jego suplementacji jest pozytywny wpływ na funkcjonowanie kości, stawów oraz tkanki łącznej. To on odpowiada za sprężystość chrząstki stawowej oraz warunkuje lepko-sprężyste właściwości płynu stawowego.\nWitamina B6. Pomaga w prawidłowej syntezie cysteiny, przyczynia się do utrzymania prawidłowego metabolizmu energetycznego, pomaga w prawidłowym funkcjonowaniu układu nerwowego oraz w utrzymaniu prawidłowego metabolizmu homocysteiny. Witamina ta przyczynia się do utrzymania prawidłowego metabolizmu białka i glikogenu.\nWitamina K2 Inaczej menachinon, pozyskany z natto. Jest zaangażowana w wiele procesów fizjologicznych zachodzących w organizmie człowieka. Przede wszystkim bierze udział w procesie krzepnięcia krwi oraz w rozwoju i prawidłowym funkcjonowaniu układu kostnego. W formie MK-7 jest najbardziej biodostępną formą witaminy K.\nWitamina D3. Zwana inaczej cholekalcyferolem. Wspiera gospodarkę wapniowo-fosforanową organizmu, utrzymuje właściwy poziom wapnia we krwi. Ma wpływ na prawidłowe funkcjonowanie mięśni.\n\nSposób użycia\n\nZalecaną porcję 20 g (3 miarki) wymieszać w 100-150 ml wody lub soku. Spożywać raz dziennie. Przed zastosowaniem wskazane jest wykonanie badania 25-(OH)D we krwi oraz konsultacja wyniku badania z lekarzem lub farmaceutą. Produkt przeznaczony dla osób dorosłych.\nNie przekraczać zalecanej dziennej porcji do spożycia. Suplement diety nie może być stosowany jako substytut (zamiennik) zróżnicowanej diety. Zalecany jest zrównoważony sposób żywienia i zdrowy tryb życia. Nie spożywać w przypadku uczulenia na którykolwiek ze składników produktu. Produkt nie powinien być stosowany przez dzieci, kobiety w ciąży, matki karmiące oraz osoby przyjmujące środki przeciwzakrzepowe zawierające antagonistów witaminy K (np. warfaryna i acenokumarol). Przechowywać w sposób niedostępny dla małych dzieci. Przechowywać w temperaturze 15-25°C, w zamkniętym opakowaniu, w suchym miejscu. Chronić przed bezpośrednim działaniem promieni słonecznych.\n\nSkładniki\nHydrolizowany kolagen wołowy, maltodekstryna, regulator kwasowości: kwas cytrynowy; metylosulfonylometan, siarczan glukozaminy 2KCL (zawiera skorupiaki), sole magnezowe kwasu cytrynowego (magnez), węglan wapnia (wapń), substancja przeciwzbrylająca: dwutlenek krzemu; kwas L-askorbinowy (witamina C), aromaty, siarczan chondroityny, substancje słodzące: sukraloza, acesulfam K; barwnik: karoteny; cholekalcyferol (witamina D), kwas hialuronowy (hialuronian sodu), chlorowodorek pirydoksyny (witamina B6), menachinon-7 MK-7 (witamina K) pochodzący z Bacillus subtilis natto.\nProdukt może zawierać mleko (łącznie z laktozą), soję, orzeszki ziemne, inne orzechy, nasiona sezamu, zboża zawierające gluten, jaja, skorupiaki, ryby.\n\n\nWartość odżywcza\n\nMasa netto produktu: 400 g\nIlość porcji w opakowaniu: 20\nWielkość porcji: 20 g\n\n\n\n\nSkładniki aktywne\nNa porcję\n% RWS*\n\n\nHydrolizowany kolagen wołowy\n10 000 mg\n-\n\n\nMetylosulfonylometan (MSM)\n500 mg\n-\n\n\nSiarczan glukozaminy 2KCL\n500 mg\n-\n\n\nWapń\n120 mg\n15%\n\n\nWitamina C\n100 mg\n125%\n\n\nMagnez\n57 mg\n15%\n\n\nSiarczan chondroityny\n40 mg\n- \n\n\nKwas hialuronowy (hialuronian sodu)\n20 mg\n-\n\n\nWitamina B6\n1 mg\n71%\n\n\nWitamina K\n75 µg\n100%\n\n\nWitamina D\n50 µg/2000 IU\n1000%\n\n\n\n *RWS - Referencyjna wartość spożycia','','ostrovit-keeza-flex-aid-400-g-lime-pear','','','','OstroVit KEEZA Flex Aid 400 g lime & pear','','','',''),
