(315,1,1,'25 sztuk - OstroVit KEEZA Good Shot Pre-Workout 100 ml\nOstroVit KEEZA Good Shot Pre-Workout to przedtreningówka w postaci shota o smaku grejpfrutowym, który dostarczy Ci energii i siły podczas aktywności fizycznej. Nasz owocowy shot stanowi połączenie aż 10 różnych składników aktywnych. Poszukujesz suplementu diety, którego składniki wspomogą wydolność i wytrzymałość Twojego organizmu, a także podniosą efektywność treningu? Postaw na OstroVit KEEZA Good Shot Pre-Workout - niewielki napój o wielkiej mocy!\nWłaściwości składników zawartych w OstroVit KEEZA Good Shot Pre-Workout:\n\nIDEALNA DAWKA ENERGII I WSPARCIE PODCZAS TRENINGU - Kofeina bezwodna pobudza do działania i pozwala zredukować uczucie zmęczenia, zaś wysoka dawka Jabłczanu L-cytruliny chroni mięśnie oraz wzmacnia uczucie pompy mięśniowej.\nDUŻA ILOŚĆ SKŁADNIKÓW AKTYWNYCH - Jeden shot naszego suplementu to kompleksowy zestaw zawierający między innymi cytrulinę w postaci jabłczanu L-cytruliny, Beta-alaninę, witaminy z grupy B, kofeinę, taurynę oraz magnez.\nWYGODNA FORMA - Shot jest gotowy do spożycia i możesz wypić go zawsze wtedy, gdy potrzebujesz.\nOWOCOWY SMAK - Smak soczystego grejpfruta to czysta przyjemność suplementacji.\n\nSprawdź, jakie składniki aktywne znajdują się w naszym suplemencie:\n\nJabłczan L-cytruliny. Wykazuje działanie antyoksydacyjne, pomaga zwiększyć efekt “pompy” mięśniowej dzięki nasileniu syntezy tlenku azotu.\nBeta-alanina. Wykazuje zdolność do buforowania mięśni, co powoduje opóźnienie zmęczenia podczas ćwiczeń o wysokiej intensywności.\nTauryna. Może wpływać na wydolność organizmu oraz zwiększać spalanie tłuszczu podczas aktywności, wspiera działanie mięśni, w tym mięśnia sercowego, hamuje procesy katabolizmu w mięśniach, wykazuje działanie neuroprotekcyjne.\nKofeina bezwodna. Dodaje energii i chęci do działania, redukuje zmęczenie, przyczynia się do zwiększenia czujności i koncentracji.\nAdenozyno-5′-trifosforan (ATP). Może poprawiać wydolność organizmu oraz zmniejszać uczucie zmęczenia.\nNiacyna (witamina B3). Przyczynia się do utrzymania prawidłowego metabolizmu energetycznego, a także pomaga w utrzymaniu prawidłowych funkcji psychologicznych. Pomaga zachować zdrowy stan skóry oraz przyczynia się do zmniejszenia uczucia zmęczenia i znużenia.\nWitamina B6. Spełnia oraz wspiera bardzo wiele funkcji fizjologicznych, jest kluczowa w poprawnym funkcjonowaniu wszystkich narządów w naszym organizmie.\nWitamina B12 (metylokobalamina). Metylokobalamina to najlepiej wchłanialna postać witaminy B12. Przyczynia się do utrzymania prawidłowego metabolizmu energetycznego oraz pomaga w prawidłowym funkcjonowaniu układu nerwowego oraz w utrzymaniu prawidłowego metabolizmu homocysteiny. Witamina ta odgrywa rolę w procesie podziału komórek.\nMagnez. Wspomaga przemiany węglowodanowe, tłuszczowe i białkowe. Wspiera przewodnictwo nerwowe i układ krążenia.\n\nSposób użycia\n\nSpożyć ½ buteleczki (50 ml) dziennie. Nie spożywać więcej niż 1 porcję dziennie. Produkt przeznaczony dla osób dorosłych. Osad jest zjawiskiem naturalnym. Wstrząsnąć przed spożyciem. Po otwarciu przechowywać w lodówce, spożyć w ciągu 48h.\nNie spożywać w przypadku uczulenia na którykolwiek ze składników suplementu. Produkt jest niewskazany dla dzieci, kobiet w ciąży, kobiet karmiących piersią. Suplement diety nie może być stosowany jako substytut (zamiennik) zróżnicowanej diety. Zalecany jest zrównoważony sposób żywienia i zdrowy tryb życia. Przechowywać w suchym, chłodnym miejscu, w temperaturze 2-25°C. Chronić przed promieniami słonecznymi i przemrożeniem. Przechowywać w sposób niedostępny dla małych dzieci.\n\nSkładniki\nWoda, jabłczan L-cytruliny, sok jabłkowy z koncentratu soku jabłkowego 20 %, tauryna, beta-alanina, adenozyno-5′-trifosforan (ATP) sól disodowa, kofeina bezwodna, aromat, sole magnezowe kwasu cytrynowego (magnez), kwas nikotynowy (niacyna), chlorowodorek pirydoksyny (witamina B6), ryboflawina (witamina B2), metylokobalamina (witamina B12), substancje słodzące: sukraloza, acesulfam K; substancje konserwujące: sorbinian potasu, benzoesan sodu.\nProdukt może zawierać mleko (łącznie z laktozą), soję, orzeszki ziemne, inne orzechy, nasiona sezamu, zboża zawierające gluten, jaja, skorupiaki, ryby.\n\n\nWartość odżywcza\n\nPojemność produktu: 100 ml\nIlość porcji w opakowaniu: 2\nWielkość porcji: 50 ml\n\n\n\n\nSkładniki aktywne\n50 ml (1 porcja)\n*%RWS\n\n\nJabłczan L-cytruliny\n2000 mg\n-\n\n\n- w tym L-cytrulina\n1300 mg\n-\n\n\nTauryna\n500 mg\n-\n\n\nAdenozyno-5′-trifosforan (ATP) sól disodowa\n200 mg\n-\n\n\nKofeina bezwodna\n175 mg\n-\n\n\nBeta-alanina\n400 mg\n-\n\n\nRyboflawina\n0.7 mg\n50%*\n\n\nNiacyna\n8 mg\n50%*\n\n\nWitamina B6\n0.7 mg\n50%*\n\n\nWitamina B12\n1.25 μg\n50%*\n\n\nMagnez\n57 mg\n50%*\n\n\n\n*RWS - Referencyjna wartość spożycia','','ostrovit-keeza-good-shot-pre-workout-25-sztuk','','','','OstroVit KEEZA Good Shot Pre-Workout - 25 sztuk','','','',''),
