(317,1,1,'OstroVit KEEZA Izotonik 500 g\nOstroVit KEEZA Izotonik to suplement diety w proszku do sporządzania roztworu napoju izotonicznego. Izotonik istotnie ułatwia regulację gospodarki wodno-elektrolitowej, czyli utraty nadmiernej ilości wody spowodowanej intensywnym wysiłkiem fizycznym czy problemami ze strony układu pokarmowego. Wysoka koncentracja witamin i minerałów to podstawa odpowiedniego nawodnienia organizmu, które jest niezbędne podczas codziennego funkcjonowania.\n\n25 porcji produktu w opakowaniu\nWysoka koncentracja witamin i minerałów\nDodatek L-karnityny\nZawiera także witaminy z grupy B\nPyszna wersja smakowa\n\nOstroVit KEEZA Izotonik\nOstroVit KEEZA Izotonik to bogactwo witamin, składników mineralnych i specjalna kompozycja elektrolitów, które są niezbędne szczególnie podczas bardzo intensywnego wysiłku fizycznego. Napój izotoniczny sprzyja prawidłowemu nawadnianiu naszego organizmu, zapobiega skurczom mięśni, przy czym zawiera niską ilość kalorii, dzięki czemu powinien sprostać oczekiwaniom osób dbających o sylwetkę. Produkt jest bardzo dobrze rozpuszczalny w wodzie i bardzo prosty w przygotowaniu. Napoje izotoniczne dedykowane są przede wszystkim sportowcom, biegaczom długodystansowym, maratończykom oraz osobom o zwiększonej codziennej aktywności fizycznej.\nWłaściwości składników zawartych w OstroVit KEEZA Izotonik:\n\nGlukoza wbrew powszechnej opinii jej obecność nie ma na celu poprawy walorów smakowych - zapewnia ona sprawne przyswajanie wody przez nasz organizm, a elektrolity dzięki połączeniu z glukozą są skuteczniej transportowane do tkanek.\nPotas wspiera odpowiednie napięcie mięśniowe. Może kontrolować objętość wody w organizmie i regulować ciśnienie. Ma wpływ na funkcjonowanie układu nerwowego.\nWapń przewodzi impulsy nerwowe. Uczestniczy w procesie dzielenia i regeneracji komórek. Wspiera krzepnięcie krwi, reguluje pracę mięśni oraz przyczynia się do regulacji aktywności hormonalnej.\nMagnez pomaga w prawidłowym funkcjonowaniu mięśni oraz w utrzymaniu równowagi elektrolitowej. Przyczynia się do utrzymania prawidłowego metabolizmu energetycznego oraz pomaga w prawidłowym funkcjonowaniu układu nerwowego.\nChlorek zapewnia odpowiednie przewodnictwo nerwowe oraz przepuszczalność błon komórkowych. Reguluje gospodarkę wodno-elektrolitową organizmu, aktywuje enzymy trawienne.\nSód utrzymuje równowagę wodno-elektrolitową oraz kwasowo-zasadową w organizmie. Uczestniczy także w transporcie substancji odżywczych do komórek.\nL-karnityna przyczynia się do spalania tkanki tłuszczowej, może także zwiększać wytrzymałość treningową.\nWitaminy z grupy B spełniają bardzo wiele funkcji w naszym organizmie - mają wpływ na funkcjonowanie układu odpornościowego, nerwowego i układu krążenia, wspierają właściwy wzrost i rozwój organizmu, biorą czynny udział w syntezie hormonów płciowych. Odgrywają istotną rolę w metabolizmie i gospodarce energetycznej.\nWitamina C jest znana z wielu cennych i niezbędnych właściwości. Odpowiada głównie za prawidłowe funkcjonowanie tkanki łącznej oraz kości, uczestniczy w syntezie kolagenu.\n\nPorcję 20 g (2.5 miarki) wymieszać w 500 ml wody. Spożywać 1 porcję w trakcie treningu.\nNie przekraczać zalecanej dziennej porcji do spożycia. Suplement diety nie może być stosowany jako substytut (zamiennik) zróżnicowanej diety. Zalecany jest zrównoważony sposób żywienia i zdrowy tryb życia. Nie spożywać w przypadku uczulenia na którykolwiek ze składników produktu. Produkt nie powinien być stosowany przez dzieci,  kobiety w ciąży i matki karmiące. Przechowywać w sposób niedostępny dla małych dzieci. Przechowywać w temperaturze 15-25°C, w zamkniętym opakowaniu, w suchym miejscu. Chronić przed bezpośrednim działaniem promieni słonecznych.\nProdukt wykazuje silne właściwości higroskopijne (silnie pochłania wilgoć). Tworzenie się zbryleń bądź jednolitej (zbitej) konsystencji nie jest oznaką utraty właściwości produktu. W takim przypadku należy rozdrobnić produkt na nowo.\n \nInformacje żywieniowe\n\n\nSkładniki\nGlukoza, maltodekstryna, sole magnezowe kwasu cytrynowego (magnez), regulator kwasowości: kwas cytrynowy; cytrynian potasu (potas), chlorek sodu (sód, chlorek), węglan wapnia (wapń), winian L-karnityny, substancja przeciwzbrylająca: dwutlenek krzemu; aromaty, barwnik: karoteny; kwas L-askorbinowy (witamina C), substancje słodzące: sukraloza, acesulfam K; kwas nikotynowy (niacyna), chlorowodorek tiaminy (tiamina), ryboflawina (witamina B2), chlorowodorek pirydoksyny (witamina B6), metylokobalamina (witamina B12).\nProdukt może zawierać mleko (łącznie z laktozą), soję, orzeszki ziemne, inne orzechy, nasiona sezamu, zboża zawierające gluten, jaja, skorupiaki, ryby.\n\n\nWartość odżywcza\n\nMasa netto produktu: 500 g\nIlość porcji w opakowaniu: 25\nWielkość porcji: 20 g\n\n\n\n\nSkładniki aktywne\nNa porcję 20 g\n% RWS*\n\n\nGlukoza\n8500 mg\n-\n\n\nSód\n256 mg\n-\n\n\nChlorek\n394 mg\n49%\n\n\nWapń\n120 mg\n15%\n\n\nMagnez\n187 mg\n50%\n\n\nPotas\n300 mg\n15%\n\n\nWinian L-karnityny\n200 mg\n-\n\n\nWitamina C\n80 mg\n100%\n\n\nTiamina (witamina B1)\n0.165 mg\n15%\n\n\nRyboflawina (witamina B2)\n0.21 mg\n15%\n\n\nNiacyna (witamina B3)\n2.4 mg\n15%\n\n\nWitamina B6\n0.21 mg\n15%\n\n\nWitamina B12\n0.375 µg\n15%\n\n\n\n \n*RWS – Referencyjna wartość spożycia','','ostrovit-keeza-isotonic-500-g-mango','','','','OstroVit KEEZA Isotonic 500 g mango','','','',''),
