(318,1,1,'OstroVit KEEZA Omega 3 Ultra 120 kapsułek\nOstroVit KEEZA Omega 3 Ultra 120 kapsułek to suplement diety wysokiej jakości, który stanowi źródło wielonienasyconych kwasów tłuszczowych omega-3. W preparacie można znaleźć związki, takie jak kwas eikozapentaenowy (EPA), kwas dokozaheksaenowy (DHA), a także witaminę E. Produkt linii KEEZA OstroVit zawiera silnie skoncentrowany olej rybi, który znajduje się w formie softgelowych kapsułek i jest dedykowany w szczególności osobom aktywnym fizycznie, którym zależy na kompleksowym uzupełnieniu diety w cenne składniki.\n\nŹródło wielonienasyconych kwasów tłuszczowych omega 3 - jedna porcja produktu zawiera 1000 mg oleju rybiego.\nBogactwo EPA i DHA - jedna kapsułka dostarcza do organizmu 330 mg kwasu eikozapentaenowego (EPA) i 220 mg kwasu dokozaheksaenowego (DHA).\nZawiera rozpuszczalną w tłuszczach witaminę E.\n1 porcja = 1 kapsułka.\nWydajność - opakowanie produktu wystarczy na 4 miesiące regularnej suplementacji.\nWygodna forma - preparat dostępny w postaci łatwych do połknięcia, żelowych kapsułek.\n\nOstroVit KEEZA Omega 3 Ultra 120 kapsułek - źródło EPA, DHA i witaminy E\nKwasy tłuszczowe omega-3 to związki zaliczane do grupy niezbędnych nienasyconych kwasów tłuszczowych (NNKT). Organizm nie jest zdolny do ich samodzielnej syntezy, dlatego też muszą być dostarczane do ustroju z zewnątrz, wraz z pożywieniem lub suplementami diety. Wśród wielonienasyconych kwasów tłuszczowych omega-3 można wyróżnić m.in. kwas eikozapentaenowy (EPA) i kwas dokozaheksaenowy (DHA), które naturalnie występują w tłustych rybach morskich oraz w owocach morza.\nOstroVit KEEZA Omega 3 Ultra to także źródło witaminy E, czyli grupy organicznych związków chemicznych, zaliczanych do witamin rozpuszczalnych w tłuszczach, spośród których największą aktywność biologiczną wykazuje, wykorzystany w preparacie, D-alfa-tokoferol. To związek, który w ludzkim organizmie magazynowany jest w tkance tłuszczowej, a także w nadnerczach.\nWłaściwości składników zawartych w OstroVit KEEZA Omega 3 Ultra:\nObecny w suplemencie OstroVit KEEZA Omega 3 Ultra kwas dokozaheksaenowy (DHA) pozwala zachować prawidłowe funkcjonowanie mózgu, a także wspiera utrzymanie właściwego widzenia. Dodatkowo kwas eikozapentaenowy (EPA) i kwas dokozaheksaenowy (DHA) przyczyniają się do prawidłowego funkcjonowania serca, a korzystne działanie występuje w przypadku spożywania 250 mg EPA i DHA dziennie. Z kolei wykorzystana w preparacie witamina E pomaga w ochronie komórek przed stresem oksydacyjnym.\nSposób użycia\nSpożywać 1 porcję (1 kapsułka) dziennie, najlepiej po posiłku, popijając odpowiednią ilością wody. U kobiet w ciąży i karmiących stosować po konsultacji z lekarzem.\nNie przekraczać zalecanej dziennej porcji do spożycia. Suplement diety nie może być stosowany jako substytut (zamiennik) zróżnicowanej diety. Zalecany jest zrównoważony sposób żywienia i zdrowy tryb życia. Nie spożywać w przypadku uczulenia na którykolwiek ze składników produktu. Przechowywać w sposób niedostępny dla małych dzieci.\nPrzechowywać w temperaturze 15-25°C, w zamkniętym opakowaniu, w suchym miejscu. Chronić przed bezpośrednim działaniem promieni słonecznych.\n\nSkładniki\nOlej rybi, otoczka kapsułki (żelatyna, substancja utrzymująca wilgoć: glicerol; woda oczyszczona), octan DL-alfa-tokoferylu (witamina E).\nProdukt może zawierać mleko (łącznie z laktozą), soję, orzeszki ziemne, inne orzechy, nasiona sezamu, zboża zawierające gluten, jaja, skorupiaki.\n\n\nWartość odżywcza\n\nMasa netto produktu: 158 g\nIlość porcji w opakowaniu: 120\nWielkość porcji: 1 kapsułka\n\n\n\n\nSkładniki aktywne\n1 kapsułka (1 porcja)\n% RWS*\n\n\nOlej rybi, w tym:\n1000 mg\n-\n\n\n- Kwas eikozapentaenowy EPA\n330 mg\n-\n\n\n- Kwas dokozaheksaenowy DHA\n220 mg\n-\n\n\nWitamina E\n2 mg\n17%\n\n\n\n*RWS - Referencyjna wartość spożycia','','ostrovit-keeza-omega-3-ultra-120-kapsulek','','','','OstroVit KEEZA Omega 3 Ultra 120 kapsułek','','','',''),
