(319,1,1,'Legginsy treningowe Manila\nElastyczne, lekkie i idealnie dopasowujące się legginsy Manila dają komfort zarówno podczas treningu, jak i wykonywania codziennych czynności. Materiał, z którego wykonaliśmy nasze legginsy charakteryzuje się niezwykłą miękkością, a wykonanie w technologii dry&amp;fit gwarantuje suchość skóry oraz wygodę nawet podczas najbardziej wymagających treningów.\nSkład: 87% poliester, 13% elastan Gramatura: 220 g','','legginsy-manila','','','','Legginsy Manila','','','',''),
